(3, 'hôm nay test web', 'hôm nay test web', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>h&ocirc;m nay test web</p>\r\n</body>\r\n</html>', 1, 1, 1, '', 'hom-nay-test-web', 'hôm nay test web', 'hôm nay test web', 'hôm nay test web', '', '', 1639623929, 0, 1648610994),
(4, 'Càng làm đẹp càng xấu đi nếu bạn không biết những điều dưới đây!', 'Xung đột căng thẳng, Fed lên kế hoạch tăng lãi suất và nhiều yếu tố vĩ mô khác đang tác động mạnh tới thị trường chứng khoán và đặc biệt là tâm lý của nhà đầu tư. Tuy nhiên, theo các chuyên gia, điều này không chỉ tiềm ẩn rủi ro, mà còn mang đến cả những cơ hội.', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p><strong>Chứng kho&aacute;n Việt v&agrave; c&acirc;u chuyện từ trời &Acirc;u</strong></p>\r\n<p>Xung đột căng thẳng, Fed l&ecirc;n kế hoạch tăng l&atilde;i suất v&agrave; nhiều yếu tố vĩ m&ocirc; kh&aacute;c đang t&aacute;c động mạnh tới thị trường chứng kho&aacute;n v&agrave; đặc biệt l&agrave; t&acirc;m l&yacute; của nh&agrave; đầu tư. Tuy nhi&ecirc;n, theo c&aacute;c chuy&ecirc;n gia, điều n&agrave;y kh&ocirc;ng chỉ tiềm ẩn rủi ro, m&agrave; c&ograve;n mang đến cả những cơ hội.</p>\r\n<p>Trao đổi c&ugrave;ng ph&oacute;ng vi&ecirc;n B&aacute;o Đầu tư Chứng kho&aacute;n, chuy&ecirc;n gia kinh tế V&otilde; Tr&iacute; Th&agrave;nh cho rằng, thị trường t&agrave;i ch&iacute;nh n&oacute;i chung c&oacute; đặc điểm l&agrave; khi c&oacute; c&uacute; sốc sẽ dẫn đến t&igrave;nh trạng bấn loạn, phản ứng th&aacute;i qu&aacute;, nhưng sau đ&oacute;, khi nh&agrave; đầu tư điềm tĩnh hơn, đ&oacute;n nhận đủ th&ocirc;ng tin hơn, nhiều chỉ b&aacute;o đ&aacute;ng tin cậy hơn th&igrave; c&aacute;ch phản ứng cũng b&igrave;nh tĩnh hơn.</p>\r\n<p>Với kinh tế Việt Nam n&oacute;i chung v&agrave; thị trường chứng kho&aacute;n n&oacute;i ri&ecirc;ng, theo &ocirc;ng Th&agrave;nh, địa ch&iacute;nh trị sẽ c&oacute; nhiều t&aacute;c động về kinh tế, điều n&agrave;y t&ugrave;y thuộc v&agrave;o quy m&ocirc;, mức độ k&eacute;o d&agrave;i, nhưng xung đột theo kiểu c&oacute; tranh gi&agrave;nh ảnh hưởng của c&aacute;c nước lớn th&igrave; hệ lụy sẽ d&agrave;i hạn. Trước mắt c&oacute; thể thấy 2 t&aacute;c động r&otilde; nhất l&agrave;: Gi&aacute; dầu tăng, rộng ra l&agrave; lạm ph&aacute;t v&agrave; gắn với lạm ph&aacute;t th&igrave; ảnh hưởng đến mức độ điều chỉnh ch&iacute;nh s&aacute;ch vĩ m&ocirc;, tiền tệ của c&aacute;c nước lớn. Điều n&agrave;y sẽ ảnh hưởng theo nghĩa l&agrave;m cho phục hồi kinh tế thế giới trở n&ecirc;n kh&oacute; khăn hơn. C&ugrave;ng với đ&oacute;, bản th&acirc;n c&aacute;c nước đang c&oacute; xung đột (chưa n&oacute;i c&aacute;c nước tham gia trừng phạt, cấm vận) cũng bị ảnh hưởng tăng trưởng kinh tế v&agrave; sẽ t&aacute;c động đến cả thế giới.</p>\r\n<p>&Ocirc;ng Th&agrave;nh cho rằng, nếu rủi ro gia tăng th&igrave; luồng tiền sẽ t&igrave;m chỗ tr&uacute; ẩn, thay v&igrave; đầu tư sản xuất - kinh doanh, c&oacute; thể sẽ được d&ugrave;ng để đầu tư t&agrave;i ch&iacute;nh, cho c&aacute;c k&ecirc;nh an to&agrave;n như v&agrave;ng, hay đồng Y&ecirc;n (Nhật Bản). Ri&ecirc;ng thị trường chứng kho&aacute;n, phản ứng phụ thuộc nhiều v&agrave;o kỳ vọng, ph&aacute;n đo&aacute;n của thị trường, nh&agrave; đầu tư về quy m&ocirc;, thời gian sự kiện&hellip; Với c&aacute;c lĩnh vực, ng&agrave;nh nghề th&igrave; c&ograve;n t&ugrave;y thuộc v&agrave;o mức độ t&aacute;c động, tương t&aacute;c, quan hệ của c&aacute;c nước xung đột với thế giới với c&aacute;c nước kh&aacute;c, với thị trường như Việt Nam chẳng hạn.</p>\r\n<table class=\"picture\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td class=\"pic\"><a class=\"photo\"><img class=\"cms-photo\" src=\"https://photo-cms-tinnhanhchungkhoan.zadn.vn/w640/Uploaded/2022/aohuojr/2022_03_05/dji-0039-7738.jpg\" alt=\"Thế giới nhiều biến động, cơ hội n&agrave;o cho nh&agrave; đầu tư? ảnh 1\" data-image-id=\"397832\" data-width=\"2000\" data-height=\"1163\" data-photo-original-src=\"https://photo-cms-tinnhanhchungkhoan.zadn.vn/Uploaded/2022/aohuojr/2022_03_05/dji-0039-7738.jpg\" /></a></td>\r\n</tr>\r\n<tr>\r\n<td class=\"caption\">\r\n<p>Cổ phiếu bất động sản khu c&ocirc;ng nghiệp vẫn đầy triển vọng. Ảnh: Th&agrave;nh Nguyễn.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>C&ograve;n theo chuy&ecirc;n gia kinh tế Nguyễn Tr&iacute; Hiếu, d&ugrave; Việt Nam c&aacute;ch xa ch&acirc;u &Acirc;u, nhưng thị trường chứng kho&aacute;n cũng mang t&iacute;nh li&ecirc;n th&ocirc;ng mạnh mẽ v&agrave; mọi sự hoảng loạn d&ugrave; ở xa cũng sẽ t&aacute;c động l&ecirc;n thị trường t&agrave;i ch&iacute;nh trong nước. T&acirc;m l&yacute; kh&ocirc;ng biết chiến sự k&eacute;o d&agrave;i bao l&acirc;u, thị trường sẽ đi theo hướng n&agrave;o của nh&agrave; đầu tư l&agrave; dễ hiểu. Diễn biến gi&aacute; v&agrave;ng trong nước v&agrave; thế giới tăng cũng đang phản &aacute;nh điều n&agrave;y, khi t&acirc;m l&yacute; lo sợ th&igrave; mua v&agrave;ng vẫn l&agrave; một th&oacute;i quen.</p>\r\n<p>Tuy nhi&ecirc;n, &ocirc;ng Hiếu cũng cho rằng, trong bối cảnh hiện tại, nh&agrave; đầu tư cần b&igrave;nh tĩnh với c&aacute;c biến cố tr&ecirc;n thế giới, v&agrave; nếu c&aacute;c b&ecirc;n t&igrave;m được giải ph&aacute;p v&agrave; đi đến thỏa thuận h&ograve;a b&igrave;nh th&igrave; thị trường sẽ nhanh ch&oacute;ng ổn định trở lại. Hiện tại, l&agrave; l&uacute;c nh&agrave; đầu tư n&ecirc;n tập trung v&agrave;o c&aacute;c cổ phiếu của doanh nghiệp c&oacute; uy t&iacute;n, c&oacute; b&aacute;o c&aacute;o t&agrave;i ch&iacute;nh tốt, trong c&aacute;c lĩnh vực c&oacute; khả năng ph&aacute;t triển, tr&aacute;nh xa c&aacute;c cổ phiếu v&agrave; lĩnh vực c&oacute; nhiều rủi ro.</p>\r\n<p>&ldquo;Hơn l&uacute;c n&agrave;o hết, hiện tại kh&ocirc;ng phải l&agrave; l&uacute;c kiếm tiền nhanh m&agrave; nh&agrave; đầu tư cần đề cao việc bảo vệ t&agrave;i sản của m&igrave;nh&rdquo;, &ocirc;ng Hiếu nhấn mạnh.</p>\r\n<p><strong>T&igrave;m cơ trong nguy</strong></p>\r\n<p>Quan s&aacute;t những t&aacute;c động từ b&ecirc;n ngo&agrave;i bi&ecirc;n giới, &ocirc;ng Đỗ Khoa, Broker C&ocirc;ng ty Chứng kho&aacute;n TP.HCM cho rằng, diễn biến thị trường n&oacute;i chung c&ograve;n phụ thuộc nhiều v&agrave;o căng thẳng Nga - Ukraine. Xung đột vũ trang lần n&agrave;y sẽ kh&ocirc;ng chỉ t&aacute;c động đến thị trường chứng kho&aacute;n Việt Nam, m&agrave; c&ograve;n cả với cả thị trường t&agrave;i ch&iacute;nh to&agrave;n cầu, cả quyết định thời điểm n&acirc;ng l&atilde;i suất, mức n&acirc;ng l&atilde;i suất của Cục Dự trữ Li&ecirc;n bang Mỹ (Fed). Trường hợp hai b&ecirc;n đ&agrave;m ph&aacute;n v&agrave; t&igrave;m được tiếng n&oacute;i chung th&igrave; t&igrave;nh h&igrave;nh c&oacute; thể ổn định trở lại.</p>\r\n<p>Trong một diễn kh&aacute;c, mới đ&acirc;y, Chủ tịch Fed, &ocirc;ng Jerome Powell cho biết, sẽ đề xuất tăng l&atilde;i suất 0,25% trong phi&ecirc;n họp ch&iacute;nh s&aacute;ch th&aacute;ng 3 tới. Chủ tịch Fed cũng cho biết, đ&atilde; sẵn s&agrave;ng n&acirc;ng l&atilde;i suất tại cuộc họp ch&iacute;nh s&aacute;ch th&aacute;ng n&agrave;y nhằm hạ nhiệt lạm ph&aacute;t. Xung đột Nga - Ukraine l&agrave;m gia tăng bất ổn kinh tế, song kh&ocirc;ng thể khiến Fed rời khỏi lộ tr&igrave;nh tăng l&atilde;i suất của m&igrave;nh.</p>\r\n<p>&ldquo;Fed đ&atilde; sẵn s&agrave;ng sử dụng tăng l&atilde;i suất với mức độ mạnh hơn, tần suất thường xuy&ecirc;n hơn nếu lạm ph&aacute;t kh&ocirc;ng giảm&rdquo;, &ocirc;ng Jerome Powell nhấn mạnh.</p>\r\n<p>C&ograve;n theo &ocirc;ng Nguyễn Việt Quang, Gi&aacute;m đốc Trung t&acirc;m kinh doanh 3, C&ocirc;ng ty Chứng kho&aacute;n Yuanta Việt Nam, d&ugrave; thế giới c&oacute; nhiều biến động, nhưng năm 2022, thị trường chứng kho&aacute;n Việt Nam vẫn c&oacute; một số cổ phiếu nh&agrave; đầu tư c&oacute; thể c&acirc;n nhắc giải ng&acirc;n, như PLX, HVN, VCI.</p>\r\n<p>L&yacute; giải r&otilde; hơn, &ocirc;ng Quang cho biết, với PLX, hiện gi&aacute; dầu đang giữ ở mức gi&aacute; cao trong khi PLX l&agrave; doanh nghiệp ng&agrave;nh dầu kh&iacute; c&oacute; trữ lượng h&agrave;ng lớn nhất sẽ tạo điều kiện tăng trưởng lợi nhuận mạnh trong năm 2022.</p>\r\n<p>C&ograve;n với HVN, tuy kết quả kinh doanh trước đ&oacute; HVN bị ảnh hưởng kh&aacute; nhiều do đại dịch, nhưng với độ phủ mũi ti&ecirc;m vaccine cũng như thuốc trị covid th&igrave; năm 2022 ng&agrave;nh h&agrave;ng kh&ocirc;ng sẽ hồi phục mạnh mẽ.</p>\r\n<p>Với VCI, thị trường chứng kho&aacute;n Việt Nam vẫn l&agrave; thị trường rất tiềm năng trong khu vực cũng như tr&ecirc;n thế giới, thị trường ch&uacute;ng ta c&ograve;n rất nhiều dư địa ph&aacute;t triển điều đ&oacute; sẽ tạo thuận lợi cho ng&agrave;nh chứng kho&aacute;n cũng như VCI tăng trưởng vượt trội trong trung v&agrave; d&agrave;i hạn.</p>\r\n<table class=\"picture\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td class=\"pic\"><a class=\"photo\"><img class=\"cms-photo\" src=\"https://photo-cms-tinnhanhchungkhoan.zadn.vn/w640/Uploaded/2022/aohuojr/2022_03_05/z3234024037568-1203adb4c98e68f01a4414233eac1adf-1-65879-6229.jpg\" alt=\"Thế giới nhiều biến động, cơ hội n&agrave;o cho nh&agrave; đầu tư? ảnh 1\" data-image-id=\"397832\" data-width=\"2000\" data-height=\"1163\" data-photo-original-src=\"https://photo-cms-tinnhanhchungkhoan.zadn.vn/w640/Uploaded/2022/aohuojr/2022_03_05/z3234024037568-1203adb4c98e68f01a4414233eac1adf-1-65879-6229.jpg\" /></a></td>\r\n</tr>\r\n<tr>\r\n<td class=\"caption\">\r\n<p>Cổ phiếu bất động sản khu c&ocirc;ng nghiệp vẫn đầy triển vọng. Ảnh: Th&agrave;nh Nguyễn.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Trao đổi với ph&oacute;ng vi&ecirc;n về cơ hội cho c&aacute;c nh&agrave; đầu tư trong giai đoạn hiện tại, đại diện CTCP Chứng kho&aacute;n Ng&acirc;n h&agrave;ng Đầu tư v&agrave; Ph&aacute;t triển Việt Nam (BSC) cho rằng, trong nước, nền kinh tế hồi phục từ v&ugrave;ng đ&aacute;y với sự mở cửa ho&agrave;n to&agrave;n nền kinh tế v&agrave; c&aacute;c giải ph&aacute;p hỗ trợ nền kinh tế, nhiều ng&agrave;nh nghề sẽ phục hồi mở ra nhiều cơ hội đầu tư nhưng phần n&agrave;o cũng ph&acirc;n t&aacute;n d&ograve;ng tiền qua đ&oacute; tr&aacute;nh đ&agrave; tăng n&oacute;ng tại một số ng&agrave;nh nghề như trong năm 2021.</p>\r\n<p>Những ng&agrave;nh dự kiến c&oacute; sự phục hồi v&agrave; tăng trưởng tốt trong năm 2022 gồm t&agrave;i ch&iacute;nh, ti&ecirc;u d&ugrave;ng, b&aacute;n lẻ, xuất khẩu, tiện &iacute;ch&hellip; Ngo&agrave;i ra, chủ trương đẩy mạnh đầu tư c&ocirc;ng cũng sẽ c&oacute; t&aacute;c động t&iacute;ch cực l&ecirc;n một số ng&agrave;nh nghề như x&acirc;y dựng hạ tầng, nguy&ecirc;n vật liệu v&agrave; ảnh hưởng gi&aacute;n tiếp đến x&acirc;y dựng v&agrave; bất động sản.</p>\r\n<p>Về quốc tế, cuộc xung đột Nga - Ukraina đang l&agrave;m trầm trọng th&ecirc;m mức tăng gi&aacute; của c&aacute;c loại nguy&ecirc;n vật liệu, trong đ&oacute; đ&aacute;ng kể nhất l&agrave; gi&aacute; dầu. Gi&aacute; dầu tăng mạnh trở lại v&ugrave;ng đỉnh c&aacute;ch đ&acirc;y 10 năm v&agrave; chưa c&oacute; dấu hiệu giảm lại đang mở ra cơ hội đầu tư nh&oacute;m cổ phiếu ng&agrave;nh dầu kh&iacute;, ph&acirc;n b&oacute;n, h&oacute;a chất v&agrave; logistic.</p>\r\n<p>\"Nh&igrave;n chung trong bối cảnh nền kinh tế thế giới hồi phục th&igrave; nhiều cơ hội đang xuất hiện nhưng sự ph&acirc;n h&oacute;a sẽ lớn dần khi c&aacute;c quốc gia đang thu hẹp v&agrave; chuyển sang thắt chặt ch&iacute;nh s&aacute;ch tiền tệ cũng như hậu quả của xung đột địa ch&iacute;nh trị. Hoạt động giao dịch nhanh tại một số ng&agrave;nh hưởng lợi từ biến động trong v&agrave; ngo&agrave;i nước như đề cập ở tr&ecirc;n vẫn l&agrave; chủ đạo trước khi c&oacute; thể định h&igrave;nh một xu hướng v&agrave; vận động r&otilde; r&agrave;ng với một số ng&agrave;nh nghề như năm 2021\", đại diện BSC nhấn mạnh.</p>\r\n<p>Từ một g&oacute;c nh&igrave;n kh&aacute;c, theo b&agrave; Trần Kh&aacute;nh Hiền, Gi&aacute;m đốc Ph&acirc;n t&iacute;ch C&ocirc;ng ty cổ phần Chứng kho&aacute;n VNDIRECT, t&aacute;c động trực tiếp của xung đột Nga - Ukraine đối với nền kinh tế Việt Nam sẽ kh&ocirc;ng lớn. Hiện giao thương giữa Việt Nam với Nga v&agrave; Ukraine chỉ chiếm khoảng 0,9% tổng gi&aacute; trị xuất nhập khẩu của Việt Nam (chiếm 1,1% gi&aacute; trị xuất khẩu v&agrave; 0,8% gi&aacute; trị nhập khẩu trong năm 2021, theo Tổng cục Hải quan) v&agrave; hai nước tr&ecirc;n cũng kh&ocirc;ng phải l&agrave; nh&agrave; đầu tư trực tiếp nước ngo&agrave;i lớn tại Việt Nam.</p>\r\n<p>Với thị trường trong nước, b&agrave; Hiền cho rằng, Việt Nam vẫn c&oacute; khả năng kiểm so&aacute;t tốt lạm ph&aacute;t dưới mục ti&ecirc;u Quốc hội đề ra. C&ugrave;ng với đ&oacute; l&agrave; việc Ch&iacute;nh phủ đang đẩy mạnh k&iacute;ch th&iacute;ch, phục hồi kinh tế, mở cửa du lịch, h&agrave;ng kh&ocirc;ng v&agrave; tạo động lực tăng trưởng cho nền kinh tế v&agrave; thị trường trong thời gian tới.</p>\r\n<p>&ldquo;Chứng kho&aacute;n Việt Nam sẽ chỉ chịu ảnh hưởng trong ngắn hạn, v&agrave; nếu c&oacute; những phi&ecirc;n điều chỉnh mạnh sẽ l&agrave; cơ hội để nh&agrave; đầu tư t&iacute;ch lũy cổ phiếu. Trong trung v&agrave; d&agrave;i hạn, triển vọng thị trường vẫn kh&aacute; lạc quan nhờ nền kinh tế tăng trưởng cao hơn trong giai đoạn tới, tăng trưởng lợi nhuận của c&aacute;c doanh nghiệp ni&ecirc;m yết vẫn duy tr&igrave; ở mức cao trong giai đoạn 2022 - 2023 v&agrave; định gi&aacute; thị trường chứng kho&aacute;n Việt Nam vẫn tương đối hấp dẫn trong trung hạn&rdquo;, b&agrave; Hiền nhấn mạnh.</p>\r\n<p>Đ&aacute;nh gi&aacute; về tiềm năng thị trường, cơ hội cho c&aacute;c nh&agrave; đầu tư, b&agrave; Hiền cho cho rằng, Nga v&agrave; Ukraine l&agrave; những nước xuất khẩu lớn về dầu kh&iacute;, sắt th&eacute;p, ph&acirc;n b&oacute;n do đ&oacute; cuộc khủng hoảng c&oacute; thể l&agrave;m đứt g&atilde;y chuỗi cung ứng, l&agrave;m gi&aacute; c&aacute;c mặt h&agrave;ng neo ở mức cao trong ngắn hạn. Do đ&oacute;, một số cổ phiếu thuộc ng&agrave;nh dầu kh&iacute;, sắt th&eacute;p, ph&acirc;n b&oacute;n sẽ được hưởng lợi từ việc gi&aacute; h&agrave;ng h&oacute;a neo ở mức cao v&agrave; nhu cầu xuất khẩu c&aacute;c mặt h&agrave;ng n&agrave;y gia tăng.</p>\r\n<p>B&ecirc;n cạnh đ&oacute;, triển vọng với ng&agrave;nh bất động sản khu c&ocirc;ng nghiệp cũng được đ&aacute;nh gi&aacute; t&iacute;ch cực với, khi d&ograve;ng vốn FDI c&oacute; xu hướng quay trở lại Việt Nam mạnh mẽ v&agrave; ng&agrave;nh b&aacute;n lẻ nhờ sức cầu trong nước dần phục hồi sau giai đoạn gi&atilde;n c&aacute;ch x&atilde; hội.</p>\r\n</body>\r\n</html>', 0, 1, 0, '', 'cang-lam-dep-cang-xau-di-neu-ban-khong-biet-nhung-dieu-duoi-day!', 'Càng làm đẹp càng xấu đi nếu bạn không biết những điều dưới đây!', 'Càng làm đẹp càng xấu đi nếu bạn không biết những điều dưới đây!', 'Càng làm đẹp càng xấu đi nếu bạn không biết những điều dưới đây!', 'http://demo.local/uploads/vinateks_outsource_chungkhoan/avatar/2022-03-30/news1.jpeg', '', 1648611093, 0, 0),
(5, 'Đại hội nghị tổng công ty BĐS Nhật Nam 2022', 'Bất động sản Nhật Nam vừa qua đã tổ chức thành công sự kiện Đại hội nghị tổng công ty, chương trình được tổ chức với quy mô lớn, quy tụ nhiều nhà đầu tư lớn trên khắp cả nước.', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p><strong><em>Bất động sản Nhật Nam vừa qua đ&atilde; tổ chức th&agrave;nh c&ocirc;ng sự kiện Đại hội nghị tổng c&ocirc;ng ty, chương tr&igrave;nh được tổ chức với quy m&ocirc; lớn, quy tụ nhiều nh&agrave; đầu tư lớn tr&ecirc;n khắp cả nước</em></strong>.</p>\r\n<div id=\"attachment_4336\" class=\"wp-caption aligncenter\"><img class=\"wp-image-4336\" title=\"Đại hội nghị tổng c&ocirc;ng ty BĐS Nhật Nam\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/Dai-hoi-nghi-tong-cong-ty-BDS-Nhat-Nam.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/Dai-hoi-nghi-tong-cong-ty-BDS-Nhat-Nam.jpg 1251w, https://dautunhatnam.vn/wp-content/uploads/2022/03/Dai-hoi-nghi-tong-cong-ty-BDS-Nhat-Nam-768x513.jpg 768w\" alt=\"Đại hội nghị tổng c&ocirc;ng ty BĐS Nhật Nam\" width=\"600\" height=\"400\" />\r\n<p id=\"caption-attachment-4336\" class=\"wp-caption-text\">Đại hội nghị tổng c&ocirc;ng ty BĐS Nhật Nam</p>\r\n</div>\r\n<p>Sang năm 2022, mặc d&ugrave; đại dịch Covid -19 vẫn c&ograve;n những diễn biến phức tạp,&nbsp;như một r&agrave;o cản v&ocirc; h&igrave;nh vẫn t&aacute;c động ti&ecirc;u cực lớn đến mọi mặt của nền kinh tế Việt Nam. Mọi lĩnh vực kinh doanh đều bị ảnh hưởng nặng nề.&nbsp;C&aacute;c&nbsp;doanh nghiệp Việt Nam đang phải đối mặt với nhiều kh&oacute; khăn bởi phải dừng mọi hoạt động sản xuất l&agrave;m ăn kinh tế. Mặc d&ugrave; kh&oacute; khăn l&agrave; vậy thế nhưng C&ocirc;ng ty BĐS&nbsp;Nhật Nam vẫn ki&ecirc;n cường đứng tr&ecirc;n thương trường như một &ldquo;chiến binh&rdquo; đầy bản lĩnh v&agrave; mạnh mẽ. Những kh&oacute; khăn m&agrave; Nhật Nam đ&atilde; trải qua đ&atilde; &ldquo;t&ocirc;i luyện tinh thần&rdquo; khiến c&ocirc;ng ty bản lĩnh hơn, lu&ocirc;n cố gắng th&iacute;ch nghi v&agrave; ph&aacute;t triển.&nbsp;</p>\r\n<p>Để kh&ocirc;ng ngủ qu&ecirc;n tr&ecirc;n những th&agrave;nh c&ocirc;ng c&ugrave;ng với những th&agrave;nh quả m&agrave; doanh nghiệp đ&atilde; đạt được đồng thời củng cố niềm tin với c&aacute;c nh&agrave; đầu tư,&nbsp;giúp cho nhà đ&acirc;̀u tư an t&acirc;m hơn v&ecirc;̀ quy&ecirc;́t định đ&acirc;̀u tư của chính mình, đồng thời củng cố v&agrave; ph&aacute;t triển doanh nghiệp hơn nữa, ng&agrave;y 13/03/2022 vừa qua, C&ocirc;ng ty BĐS Nhật Nam đ&atilde; tổ chức&nbsp;Đại Hội Nghị Tổng C&ocirc;ng Ty.</p>\r\n<p>Sự kiện được diễn ra v&agrave;o hồi 13h30 ng&agrave;y 13/03/2022 tại Sảnh MMH &ndash; Trung t&acirc;m Hội nghị Quốc Gia, Cổng số 1 ĐCT08, Đại lộ Thăng Long &ndash; Mễ Tr&igrave; &ndash; Nam Từ Li&ecirc;m &ndash; H&agrave; Nội.</p>\r\n<h2><strong>Nội dung Hội Nghị Cổ Đ&ocirc;ng C&ocirc;ng Ty Nhật Nam Ng&agrave;y 13/3/2022</strong></h2>\r\n<p>Bước sang năm 2022 thế giới lại một lần nữa rơi v&agrave;o l&agrave;n s&oacute;ng lạm ph&aacute;t kinh tế mạnh mẽ bởi chiến sự tại ch&acirc;u &Acirc;u c&ugrave;ng với&nbsp;t&igrave;nh h&igrave;nh dịch bệnh Covid &ndash; 19 vẫn đang c&oacute; những diễn biến phức tạp với số ca nhiễm tăng vọt l&ecirc;n từng ng&agrave;y.&nbsp;Tất cả đ&atilde; cộng hưởng tạo n&ecirc;n&nbsp;nhiều kh&oacute; khăn trong t&igrave;nh h&igrave;nh kinh doanh, theo đ&oacute; để tiếp tục duy tr&igrave; sự ổn định v&agrave; gặt h&aacute;i những th&agrave;nh c&ocirc;ng bất chấp những l&agrave;n s&oacute;ng dữ.&nbsp;</p>\r\n<p>Nhật Nam Group tổ chức Đại Hội Nghị Tổng C&ocirc;ng Ty với c&aacute;c mục ti&ecirc;u cụ thể như sau:</p>\r\n<ul>\r\n<li>Đ&aacute;nh gi&aacute; t&igrave;nh h&igrave;nh hoạt động của qu&yacute; 1/2022.</li>\r\n<li>X&acirc;y dựng c&aacute;c kế hoạch cho qu&yacute; 2/2022 v&agrave; c&aacute;c qu&yacute; tiếp theo.</li>\r\n<li>Củng cố v&agrave; x&acirc;y dựng chiến lược mở rộng cho c&aacute;c hoạt động kinh doanh của chuỗi hệ sinh th&aacute;i nh&agrave; h&agrave;ng, kh&aacute;ch sạn, karaoke, cafe doanh nh&acirc;n.</li>\r\n<li>Triển khai cũng như x&acirc;y dựng kế hoạch cho c&aacute;c dự &aacute;n bất động sản lớn trong thời gian tới.</li>\r\n<li>Chương tr&igrave;nh bốc thăm tr&uacute;ng thưởng gi&aacute; trị: Xe hơi Vinfast Fadil. Xe tay ga Sh mode, điện thoại Iphone 13 v&agrave; nhiều phần qu&agrave; hấp dẫn kh&aacute;c sẵn s&agrave;ng trao tay nh&agrave; đầu tư.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<div id=\"attachment_4333\" class=\"wp-caption aligncenter\"><img class=\"wp-image-4333 size-full\" title=\"C&aacute;c sự kiện của c&ocirc;ng ty BĐS Nhật Nam lu&ocirc;n thu h&uacute;t sự quan t&acirc;m của cộng đồng nh&agrave; đầu tư\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/Cac-su-kien-cua-cong-ty-BDS-Nhat-Nam-luon-thu-hut-su-quan-tam-cua-cong-dong-nha-dau-tu.jpg\" alt=\"C&aacute;c sự kiện của c&ocirc;ng ty BĐS Nhật Nam lu&ocirc;n thu h&uacute;t sự quan t&acirc;m của cộng đồng nh&agrave; đầu tư\" width=\"600\" height=\"400\" />\r\n<p id=\"caption-attachment-4333\" class=\"wp-caption-text\">C&aacute;c sự kiện của c&ocirc;ng ty BĐS Nhật Nam lu&ocirc;n thu h&uacute;t sự quan t&acirc;m của cộng đồng nh&agrave; đầu tư</p>\r\n</div>\r\n<p>Buổi họp sẽ quy tụ đầy đủ sự tham gia của những cổ đ&ocirc;ng chiến lược, đ&acirc;y sẽ l&agrave; cơ hội để ban l&atilde;nh đạo c&ugrave;ng c&aacute;c cổ đ&ocirc;ng chiến lược c&ugrave;ng ngồi xuống v&agrave; nh&igrave;n lại những g&igrave; đ&atilde; ho&agrave;n th&agrave;nh theo đ&uacute;ng những kế hoạch đề ra trước đ&oacute;.</p>\r\n<div id=\"attachment_4335\" class=\"wp-caption aligncenter\"><img class=\"wp-image-4335 size-full\" title=\"Đại Hội Nghị Tổng C&ocirc;ng Ty Nhật Nam\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/Dai-Hoi-Nghi-Tong-Cong-Ty-Nhat-Nam-1.jpg\" alt=\"Đại Hội Nghị Tổng C&ocirc;ng Ty Nhật Nam\" width=\"600\" height=\"450\" />\r\n<p id=\"caption-attachment-4335\" class=\"wp-caption-text\">Đại Hội Nghị Tổng C&ocirc;ng Ty Nhật Nam</p>\r\n</div>\r\n<p>B&ecirc;n cạnh đ&oacute;, c&ograve;n c&oacute; sự g&oacute;p mặt của những ng&ocirc;i sao nổi tiếng trong sự kiện, c&ugrave;ng nhiều tiết mục văn nghệ, &acirc;m thanh &ndash; &aacute;nh s&aacute;ng sống động.</p>\r\n<h2><strong>Chương tr&igrave;nh r&uacute;t thăm tr&uacute;ng thưởng c&ugrave;ng Nhật Nam Group</strong></h2>\r\n<p>Tại sự kiện ch&uacute;ng t&ocirc;i c&ograve;n muốn đem đến cho nh&agrave; đầu tư lời tri &acirc;n khi đ&atilde; đồng h&agrave;nh c&ugrave;ng c&ocirc;ng ty khi tổ chức chương tr&igrave;nh r&uacute;t thăm tr&uacute;ng thưởng với những phần qu&agrave; v&ocirc; c&ugrave;ng gi&aacute; trị với:&nbsp;&nbsp;&nbsp;</p>\r\n<ul>\r\n<li>Giải Đặc biệt: Xe hơi Vinfast Fadil</li>\r\n<li>Giải Nhất: Honda Sh Mode</li>\r\n<li>Giải Nh&igrave;: Điện thoại IPhone 13</li>\r\n<li>Giải Ba: TV Samsung</li>\r\n<li>Giải Khuyến kh&iacute;ch: L&ograve; vi s&oacute;ng.</li>\r\n</ul>\r\n<div id=\"attachment_4270\" class=\"wp-caption aligncenter\"><img class=\"wp-image-4270\" title=\"Chương tr&igrave;nh bố thăm tr&uacute;ng thưởng nh&acirc;n dịp đại hội nghị tổng c&ocirc;ng ty\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/Chuong-trinh-bo-tham-trung-thuong-nhan-dip-dai-hoi-nghi-tong-cong-ty.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/Chuong-trinh-bo-tham-trung-thuong-nhan-dip-dai-hoi-nghi-tong-cong-ty.jpg 901w, https://dautunhatnam.vn/wp-content/uploads/2022/03/Chuong-trinh-bo-tham-trung-thuong-nhan-dip-dai-hoi-nghi-tong-cong-ty-768x512.jpg 768w\" alt=\"Chương tr&igrave;nh bố thăm tr&uacute;ng thưởng nh&acirc;n dịp đại hội nghị tổng c&ocirc;ng ty\" width=\"600\" height=\"400\" />\r\n<p id=\"caption-attachment-4270\" class=\"wp-caption-text\">Chương tr&igrave;nh bố thăm tr&uacute;ng thưởng nh&acirc;n dịp đại hội nghị tổng c&ocirc;ng ty</p>\r\n</div>\r\n<h2><strong>Nhật Nam Group &ndash; Kiến tạo những gi&aacute; trị bền vững</strong></h2>\r\n<p>Th&ocirc;ng qua buổi sự kiện lớn vừa qua, Nhật Nam c&agrave;ng c&oacute; th&ecirc;m động lực, tiếp tục ph&aacute;t huy những th&agrave;nh quả đ&atilde; được v&agrave; sẽ tiến l&ecirc;n ph&iacute;a trước theo mục ti&ecirc;u đ&atilde; chọn. Hơn bao giờ hết, Nhật Nam lu&ocirc;n mong c&oacute; nhiều cơ hội để hợp t&aacute;c c&ugrave;ng qu&yacute; nh&agrave; đầu tư nhằm n&acirc;ng cao hiệu suất kinh doanh, c&ugrave;ng nhau ph&aacute;t triển để kiến tạo n&ecirc;n những gi&aacute; trị tốt đẹp cho cộng đồng.&nbsp;</p>\r\n<p>Với những th&agrave;nh c&ocirc;ng m&agrave; ch&uacute;ng t&ocirc;i đ&atilde; gặt h&aacute;i được, năm 2022 n&agrave;y với những thử th&aacute;ch đẩy hứa hẹn v&agrave; bất chấp t&igrave;nh h&igrave;nh Covid &ndash; 19 v&agrave; lạm ph&aacute;t từ chiến sự đang diễn biến phức tạp, doanh nghiệp vẫn sẽ c&oacute; bước đi đầy khởi sắc trong giai đoạn sắp tới, kiến tạo những gi&aacute; trị bền vững cho cộng đồng nh&agrave; đầu tư trong nước v&agrave; quốc tế.</p>\r\n</body>\r\n</html>', 18, 1, 0, '', 'dai-hoi-nghi-tong-cong-ty-bds-nhat-nam-2022', 'Đại hội nghị tổng công ty BĐS Nhật Nam 2022', 'Đại hội nghị tổng công ty BĐS Nhật Nam 2022', 'Đại hội nghị tổng công ty BĐS Nhật Nam 2022', 'http://demo.local/uploads/vinateks_outsource_chungkhoan/avatar/2022-03-30/Chuong-trinh-bo-tham-trung-thuong-nhan-dip-dai-hoi-nghi-tong-cong-ty.jpeg', '', 1648612412, 0, 0),
(6, 'Công ty BĐS Nhật Nam chúc mừng ngày 8/3', 'Tháng 3 về với hương xuân, sắc xuân lại tràn ngập đất trời. Xuân đến như gợi ý chúng ta về ngày tôn vinh vẻ đẹp và tầm quan trọng của người phụ nữ Việt. Nhân dịp Quốc tế Phụ nữ mùng 8/3, Công ty BĐS Nhật Nam xin gửi đến một nửa thế giới những lời chúc ý nghĩa và tốt đẹp nhất. ', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<div class=\"w-single-header\">\r\n<h1>C&ocirc;ng ty BĐS Nhật Nam ch&uacute;c mừng ng&agrave;y 8/3</h1>\r\n<div class=\"w-date\">&nbsp;</div>\r\n</div>\r\n<div class=\"entry-content\">\r\n<div id=\"attachment_4308\" class=\"wp-caption aligncenter\"><img class=\"wp-image-4308\" title=\"BĐS Nhật Nam ch&uacute;c mừng ng&agrave;y Quốc tế Phụ nữ 8/3\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/chuc-mung-ngay-8-thang-3-1.jpg\" sizes=\"(max-width: 600px) 100vw, 600px\" srcset=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/chuc-mung-ngay-8-thang-3-1.jpg 1251w, https://dautunhatnam.vn/wp-content/uploads/2022/03/chuc-mung-ngay-8-thang-3-1-768x513.jpg 768w\" alt=\"BĐS Nhật Nam ch&uacute;c mừng ng&agrave;y Quốc tế Phụ nữ 8/3\" width=\"600\" height=\"400\" />\r\n<p id=\"caption-attachment-4308\" class=\"wp-caption-text\">BĐS Nhật Nam ch&uacute;c mừng ng&agrave;y Quốc tế Phụ nữ 8/3</p>\r\n</div>\r\n<p><em>Th&aacute;ng 3 về với hương xu&acirc;n, sắc xu&acirc;n lại tr&agrave;n ngập đất trời. Xu&acirc;n đến như gợi &yacute; ch&uacute;ng ta về ng&agrave;y t&ocirc;n vinh vẻ đẹp v&agrave; tầm quan trọng của người phụ nữ Việt. Nh&acirc;n dịp Quốc tế Phụ nữ m&ugrave;ng 8/3, C&ocirc;ng ty BĐS Nhật Nam xin gửi đến một nửa thế giới những lời ch&uacute;c &yacute; nghĩa v&agrave; tốt đẹp nhất.&nbsp;</em></p>\r\n<h2><strong>BĐS Nhật Nam ch&uacute;c mừng ng&agrave;y quốc tế phụ nữ 8/3</strong></h2>\r\n<p>Đ&atilde; th&agrave;nh một n&eacute;t văn h&oacute;a truyền thống, h&agrave;ng năm ng&agrave;y 8/3, một nửa thế giới xinh đẹp của ch&uacute;ng ta lại h&acirc;n hoan đ&oacute;n nhận những lời ch&uacute;c mừng, y&ecirc;u thương, b&agrave;y tỏ t&igrave;nh cảm từ những người th&acirc;n d&agrave;nh cho chị em.&nbsp;</p>\r\n<p>Ng&agrave;y 8/3 trở th&agrave;nh ng&agrave;y Hội phụ nữ thế giới, đo&agrave;n kết đấu tranh để tự giải ph&oacute;ng thực hiện quyền nam nữ b&igrave;nh đẳng.&nbsp;</p>\r\n<p>C&ograve;n đối với ng&agrave;y 8/3 ở nước ta c&ograve;n l&agrave; ng&agrave;y kỷ niệm cuộc khởi nghĩa Hai B&agrave; Trưng. Ng&agrave;y kỷ niệm n&agrave;y cũng l&agrave; dịp cho tất cả mỗi người d&acirc;n Việt Nam tự h&agrave;o v&agrave; h&atilde;nh diện về kh&iacute; ph&aacute;ch h&agrave;o h&ugrave;ng của Hai B&agrave;. Để lại n&eacute;t đẹp truyền thống, dấu son s&aacute;ng trong lịch sử đấu tranh h&agrave;o h&ugrave;ng của d&acirc;n tộc niềm tự h&agrave;o v&agrave; &yacute; ch&iacute; vươn l&ecirc;n của những người phụ nữ Việt Nam.<br />Cho đến ng&agrave;y nay, tinh thần ki&ecirc;n cường bất khuất của những người phụ nữ vẫn c&ograve;n đang nung nấu trong t&acirc;m hồn. Phụ nữ Việt Nam tiếp tục &ldquo;Năng động &ndash; S&aacute;ng tạo &ndash; Trung hậu &ndash; Đảm đang&rdquo;, chủ động, tự tin vượt qua mọi kh&oacute; khăn th&aacute;ch thức, tiếp cận với c&ocirc;ng nghệ th&ocirc;ng tin, tự học tập, t&iacute;ch lũy, l&agrave;m gi&agrave;u tri thức cho ch&iacute;nh bản th&acirc;n m&igrave;nh để phục vụ tốt cho sự nghiệp v&agrave; cuộc sống.</p>\r\n<p>Những người phụ nữ đấy ng&agrave;y nay kh&ocirc;ng chỉ trọn vẹn chăm lo cho gia đ&igrave;nh m&agrave; c&ograve;n l&agrave; người lao động kiếm tiền, nh&acirc;n tố quan trọng kh&ocirc;ng thể thiếu trong việc l&agrave;m chủ kinh tế, ph&aacute;t triển x&atilde; hội. Họ đang hướng tới một h&igrave;nh ảnh th&agrave;nh đạt, xinh đẹp hơn. Một minh chứng l&agrave; ở một số nước tr&ecirc;n thế giới đ&atilde; xuất hiện những người phụ nữ cầm quyền l&atilde;nh đạo, hay kh&ocirc;ng n&oacute;i đ&acirc;u xa, ch&iacute;nh C&ocirc;ng ty Nhật Nam cũng c&oacute; một người phụ nữ quyền lực nhất c&ocirc;ng ty &ndash; Chủ tịch Vũ Thị Th&uacute;y.&nbsp;</p>\r\n<div id=\"attachment_4309\" class=\"wp-caption aligncenter\"><img class=\"wp-image-4309 size-full\" title=\"Chủ tịch Vũ Thị Th&uacute;y - C&ocirc;ng ty BĐS Nhật Nam\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/Chu-tich-Vu-Thi-Thuy.jpg\" alt=\"Chủ tịch Vũ Thị Th&uacute;y - C&ocirc;ng ty BĐS Nhật Nam \" width=\"600\" height=\"400\" />\r\n<p id=\"caption-attachment-4309\" class=\"wp-caption-text\">Chủ tịch Vũ Thị Th&uacute;y &ndash; C&ocirc;ng ty BĐS Nhật Nam</p>\r\n</div>\r\n<h2><strong>BĐS Nhật Nam xin gửi những lời tri &acirc;n s&acirc;u sắc nhất</strong></h2>\r\n<p>Đầu ti&ecirc;n, Nhật Nam muốn b&agrave;y tỏ l&ograve;ng cảm ơn v&agrave; k&iacute;nh trọng đối với chủ tịch Vũ Thị Th&uacute;y &ndash;&nbsp;Nữ &ldquo;Thuyền trưởng&rdquo; của BĐS Nhật Nam,&nbsp;người phụ nữ được v&iacute; như &ldquo;B&ocirc;ng hồng th&eacute;p&rdquo; đầy bản lĩnh tr&ecirc;n thương trường. Với những bước đi t&aacute;o bạo, chị đ&atilde; th&agrave;nh lập v&agrave; từng bước dẫn dắt &ldquo;đứa con tinh thần&rdquo; &ndash; C&ocirc;ng ty BĐS Nhật Nam&nbsp;trải qua bao biến cố thăng trầm v&agrave;&nbsp;ph&aacute;t triển l&ecirc;n một tầm cao mới. Xin thay mặt to&agrave;n thể CBCNV c&ocirc;ng ty ch&uacute;c Chủ tịch m&atilde;i giữ vững được bản lĩnh, sự tự tin để tiếp tục đ&aacute;nh những mốc son s&aacute;ng ch&oacute;i, những th&agrave;nh tựu mới của c&ocirc;ng ty ch&uacute;ng ta.</p>\r\n<p>Với tập thể CBCNV c&ocirc;ng ty, ch&uacute;ng t&ocirc;i xin được ghi nhận những c&ocirc;ng lao đ&oacute;ng g&oacute;p của to&agrave;n thể chị em v&agrave; xin ch&acirc;n th&agrave;nh cảm ơn mọi người đ&atilde; c&ugrave;ng s&aacute;t c&aacute;nh b&ecirc;n nhau tạo th&agrave;nh một c&ocirc;ng động Nhật Nam vững mạnh như ng&agrave;y h&ocirc;m nay. V&agrave; mong rằng ch&uacute;ng ta sẽ c&ugrave;ng đồng l&ograve;ng, đo&agrave;n kết đưa thương hiệu Nhật Nam đến từng kh&aacute;ch h&agrave;ng, vươn xa hơn tr&ecirc;n thị trường quốc tế.</p>\r\n<p>Đặc biệt hơn, BĐS Nhật Nam xin gửi những lời ch&uacute;c ch&acirc;n th&agrave;nh đến qu&yacute; kh&aacute;ch h&agrave;ng. Ch&uacute;c một nửa thế giới của ch&uacute;ng ta ng&agrave;y c&agrave;ng th&agrave;nh c&ocirc;ng, xinh đẹp v&agrave; ngập tr&agrave;n hạnh ph&uacute;c. Giữ vững những đức t&iacute;nh tốt đẹp, truyền thống qu&yacute; b&aacute;u v&agrave; kh&ocirc;ng ngừng vươn l&ecirc;n l&agrave;m chủ tương lai.</p>\r\n</div>\r\n</body>\r\n</html>', 18, 1, 0, '', 'cong-ty-bds-nhat-nam-chuc-mung-ngay-8-3', 'Công ty BĐS Nhật Nam chúc mừng ngày 8/3', 'Công ty BĐS Nhật Nam chúc mừng ngày 8/3', 'Công ty BĐS Nhật Nam chúc mừng ngày 8/3', 'http://demo.local/uploads/vinateks_outsource_chungkhoan/avatar/2022-03-30/chuc-mung-ngay-8-thang-3-1.jpeg', '', 1648612608, 0, 0),
(7, 'BĐS Nhật Nam- Tưng bừng khai trương nhà hàng cao cấp 5 sao', 'Tháng hai với những bộn bề cuộc sống, một sự khởi đầu cho những dự định năm mới. Tháng hai là tháng của mùa xuân, sắc hồng trên những cánh hoa nở rộ khắp vùng trời. Dẫu cho đại dịch đang gây nên tác động không nhỏ đến nền kinh tế thì BĐS Nhật Nam vẫn tiếp tục phát triển mạnh mẽ. Nối tiếp thành công ', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Th&aacute;ng hai với những bộn bề cuộc sống, một sự khởi đầu cho những dự định năm mới. Th&aacute;ng hai l&agrave; th&aacute;ng của m&ugrave;a xu&acirc;n, sắc hồng tr&ecirc;n những c&aacute;nh hoa nở rộ khắp v&ugrave;ng trời. Dẫu cho đại dịch đang g&acirc;y n&ecirc;n t&aacute;c động kh&ocirc;ng nhỏ đến nền kinh tế th&igrave; BĐS Nhật Nam vẫn tiếp tục ph&aacute;t triển mạnh mẽ. Nối tiếp th&agrave;nh c&ocirc;ng của chuỗi hệ thống văn ph&ograve;ng, Nhật Nam tiếp tục khai trương th&ecirc;m chuỗi nh&agrave; h&agrave;ng cao cấp tại H&agrave; Nội. Đ&acirc;y được xem l&agrave; sự khẳng định mạnh mẽ về một thương hiệu trẻ nhưng kh&ocirc;ng ngừng cố gắng nỗ lực vươn l&ecirc;n, bất chấp đại dịch.&nbsp;</p>\r\n<h2><strong>Tưng bừng khai trương nh&agrave; h&agrave;ng cao cấp Nhật Nam</strong></h2>\r\n<p>Đ&aacute;nh dấu cho một năm thịnh vượng c&ugrave;ng với nhiều th&agrave;nh tựu m&agrave; Nhật Nam đ&atilde; đạt được trong năm vừa qua. Th&igrave; h&ocirc;m nay, ng&agrave;y 26/02/2022 nh&agrave; h&agrave;ng cao cấp Nhật Nam đ&atilde; ch&iacute;nh thức được khai trương. Với m&ocirc; h&igrave;nh nh&agrave; h&agrave;ng cao cấp được t&iacute;ch hợp c&aacute;c kh&ocirc;ng gian Cafe, Spa, Karaoke, kh&ocirc;ng gian rộng lớn v&agrave; hiện đại sẽ khiến qu&yacute; kh&aacute;ch h&agrave;ng sẽ c&oacute; ph&uacute;t gi&acirc;y trọn vẹn tuyệt vời b&ecirc;n bạn b&egrave;, đồng nghiệp, đối t&aacute;c, v&agrave; gia đ&igrave;nh. Nh&agrave; h&agrave;ng c&oacute; địa chỉ tại số 12 phố Đồng B&aacute;t, Mỹ Đ&igrave;nh 2, Từ Li&ecirc;m, H&agrave; Nội.&nbsp;</p>\r\n<p>Đ&acirc;y l&agrave; một trong những kế hoạch ph&aacute;t triển kinh doanh của Nhật Nam trong mảng dịch vụ, nhằm khẳng định tiềm lực t&agrave;i ch&iacute;nh lớn mạnh v&agrave; vị thế của c&ocirc;ng ty tr&ecirc;n thị trường, vừa tạo dựng được sự tin tưởng tuyệt đối đến với qu&yacute; nh&agrave; đầu tư, kh&aacute;ch h&agrave;ng v&agrave; c&aacute;c đối t&aacute;c.</p>\r\n<p>Một số h&igrave;nh ảnh của nh&agrave; h&agrave;ng:</p>\r\n<p><img class=\"aligncenter wp-image-4214 size-full\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/02/Nha-hang-cao-cap-Nhat-Nam.jpg\" alt=\"Nh&agrave; h&agrave;ng cao cấp Nhật Nam\" width=\"600\" height=\"457\" /></p>\r\n<p><img class=\"aligncenter wp-image-4215 size-full\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/02/Khai-truong-nha-hang-cao-cap-Nhat-Nam.jpg\" alt=\"Khai trương nh&agrave; h&agrave;ng cao cấp Nhật Nam\" width=\"600\" height=\"451\" /></p>\r\n<p><img class=\"aligncenter wp-image-4216 size-full\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/02/Khai-truong-nha-hang-cao-cap-Nhat-Nam-1.jpg\" alt=\"Khai trương nh&agrave; h&agrave;ng cao cấp Nhật Nam\" width=\"600\" height=\"803\" /></p>\r\n<div id=\"attachment_4217\" class=\"wp-caption aligncenter\"><img class=\"wp-image-4217 size-full\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/02/Khai-truong-nha-hang-cao-cap-Nhat-Nam-2.jpg\" alt=\"Khai trương nh&agrave; h&agrave;ng cao cấp Nhật Nam\" width=\"600\" height=\"803\" />\r\n<p id=\"caption-attachment-4217\" class=\"wp-caption-text\">H&igrave;nh ảnh khai trương nh&agrave; h&agrave;ng cao cấp Nhật Nam</p>\r\n</div>\r\n<h2><strong>BĐS Nhật Nam định hướng tương lai &ndash; Vươn tầm cao mới</strong></h2>\r\n<p>Từ khi th&agrave;nh lập đến nay, BĐS Nhật Nam đ&atilde; trải qua mu&ocirc;n v&agrave;n kh&oacute; khăn th&aacute;ch thức. Thế nhưng kh&ocirc;ng v&igrave; thế m&agrave; Nhật Nam nản l&ograve;ng, doanh nghiệp hiểu r&otilde; mục đ&iacute;ch sinh ra của m&igrave;nh từ đ&oacute; l&agrave;m động lực để tiếp tục cố gắng hơn nữa, với hy vọng đem đến cho kh&aacute;ch h&agrave;ng cũng như cộng đồng những gi&aacute; trị bền vững, c&oacute; &iacute;ch cho x&atilde; hội.&nbsp;</p>\r\n<p>Bất động sản Nhật Nam lu&ocirc;n kh&ocirc;ng ngừng nỗ lực phấn đấu ph&aacute;t triển bền vững trở th&agrave;nh doanh nghiệp h&agrave;ng đầu Việt Nam trong nhiều lĩnh vực đầu tư, kinh doanh v&agrave; quản l&yacute; bất động sản. Với đường hướng kinh doanh mới mẻ c&ugrave;ng với định hướng ph&aacute;t triển l&acirc;u d&agrave;i bền vững. Mục ti&ecirc;u của năm 2022, Nhật Nam trở th&agrave;nh TOP 5 doanh nghiệp bất động sản ti&ecirc;u biểu về số lượng giao dịch bất động sản tại thị trường Việt Nam.&nbsp;V&agrave; tin rằng với sự đồng l&ograve;ng từ ph&iacute;a kh&aacute;ch h&agrave;ng v&agrave; c&ocirc;ng ty, Nhật Nam sẽ tiếp tục tham vọng mở rộng th&ecirc;m cơ hội đồng h&agrave;nh cho nhiều nh&agrave; đầu tư hơn nữa để c&ugrave;ng nhau th&agrave;nh c&ocirc;ng. Chinh phục mọi mục ti&ecirc;u, ho&agrave;n th&agrave;nh sứ mệnh v&agrave; theo đuổi con đường vươn tới th&agrave;nh c&ocirc;ng trong tương lai.</p>\r\n</body>\r\n</html>', 18, 1, 0, '', 'bds-nhat-nam-tung-bung-khai-truong-nha-hang-cao-cap-5-sao', 'BĐS Nhật Nam- Tưng bừng khai trương nhà hàng cao cấp 5 sao', 'BĐS Nhật Nam- Tưng bừng khai trương nhà hàng cao cấp 5 sao', 'BĐS Nhật Nam- Tưng bừng khai trương nhà hàng cao cấp 5 sao', 'http://demo.local/uploads/vinateks_outsource_chungkhoan/avatar/2022-03-30/Khai-truong-nha-hang-cao-cap-Nhat-Nam.jpeg', '', 1648612712, 0, 0),
(8, 'Nhật Nam chính thức ra mắt dịch vụ Spa', 'Được thành lập từ năm 2019, Công ty CPTM&ĐT Bất động sản Nhật Nam đã nhanh chóng phát triển và tạo dựng được vị thế vững mạnh khi nhanh chóng sở hữu những chuỗi dịch vụ nhà hàng, khách sạn, karaoke,… Và mới đây Công ty Nhật Nam lại tiếp tục mở rộng sang lĩnh vực làm đẹp khi Trung tâm dịch vụ SPA KUL', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Được th&agrave;nh lập từ năm 2019, C&ocirc;ng ty CPTM&ĐT Bất động sản Nhật Nam đ&atilde; nhanh ch&oacute;ng ph&aacute;t triển v&agrave; tạo dựng được vị thế vững mạnh khi nhanh ch&oacute;ng sở hữu những chuỗi dịch vụ nh&agrave; h&agrave;ng, kh&aacute;ch sạn, karaoke,&hellip; V&agrave; mới đ&acirc;y C&ocirc;ng ty Nhật Nam lại tiếp tục mở rộng sang lĩnh vực l&agrave;m đẹp khi Trung t&acirc;m dịch vụ SPA KUL ch&iacute;nh thức được ra mắt.&nbsp;</p>\r\n<p><strong>Trung t&acirc;m dịch vụ KUL SPA &ndash; Beauty Center</strong>&nbsp;với đội ngũ b&aacute;c sĩ da liễu c&oacute; nhiều kinh nghiệm, c&ugrave;ng c&aacute;c chuy&ecirc;n vi&ecirc;n chăm s&oacute;c kh&aacute;ch h&agrave;ng chuy&ecirc;n nghiệp bằng cả nhiệt huyết v&agrave; đam m&ecirc; với nghề.</p>\r\n<p>Với kh&ocirc;ng gian sang trọng thoải m&aacute;i v&agrave; đẳng cấp c&ugrave;ng trang thiết bị m&aacute;y m&oacute;c đạt ti&ecirc;u chuẩn h&agrave;ng đầu Việt Nam. Nằm trong Nh&agrave; h&agrave;ng Nhật Nam tọa lạc tại&nbsp;12 phố Đồng B&aacute;t, Mỹ Đ&igrave;nh 2, Từ Li&ecirc;m, H&agrave; Nội. Nơi đ&acirc;y l&agrave; một trong những kế hoạch ph&aacute;t triển kinh doanh của Nhật Nam trong mảng dịch vụ, nhằm đem đến gi&aacute; trị tốt đẹp cho cuộc sống, tạo n&ecirc;n thương hiệu để chị em phụ nữ lựa chọn v&agrave; gửi gắm niềm tin thay đổi nhan sắc ho&agrave;n hảo.</p>\r\n<h2>Chất lượng dịch vụ Spa vượt trội&nbsp;</h2>\r\n<p>Ri&ecirc;ng tại KUL SPA, việc chăm s&oacute;c sức khỏe to&agrave;n diện kh&ocirc;ng đơn thuần l&agrave; l&agrave;m dịch vụ để kh&aacute;ch h&agrave;ng c&oacute; diện mạo tươi tắn, m&agrave;&nbsp;c&ograve;n phải n&acirc;ng niu, quan t&acirc;m v&agrave; đồng h&agrave;nh c&ugrave;ng kh&aacute;ch h&agrave;ng xuy&ecirc;n suốt trong qu&aacute; tr&igrave;nh l&agrave;m đẹp đ&oacute;. Ch&uacute;ng t&ocirc;i muốn đem đến một trải nghiệm thoải m&aacute;i gi&uacute;p qu&yacute; kh&aacute;ch tận hưởng khoảng thời gian thư gi&atilde;n sau một ng&agrave;y mệt mỏi.&nbsp;&nbsp;</p>\r\n<p><img class=\"aligncenter wp-image-4323 size-full\" title=\"Đội ngũ b&aacute;c sĩ của Trung t&acirc;m Spa gi&agrave;u kinh nghiệm\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/Doi-ngu-bac-si-cua-Trung-tam-chuyen-nghiep.jpg\" alt=\"Đội ngũ b&aacute;c sĩ của Trung t&acirc;m Spa gi&agrave;u kinh nghiệm \" width=\"600\" height=\"400\" /></p>\r\n<div id=\"attachment_4324\" class=\"wp-caption aligncenter\"><img class=\"wp-image-4324 size-full\" title=\"Chất lượng chăm s&oacute;c với dịch vụ v&agrave; đội ngũ y b&aacute;c sĩ chuy&ecirc;n nghiệp\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/Chat-luong-cham-soc-voi-dich-vu-chuyen-nghiep.jpg\" alt=\"Chất lượng chăm s&oacute;c với dịch vụ v&agrave; đội ngũ y b&aacute;c sĩ chuy&ecirc;n nghiệp\" width=\"600\" height=\"400\" />\r\n<p id=\"caption-attachment-4324\" class=\"wp-caption-text\">Chất lượng chăm s&oacute;c với dịch vụ v&agrave; đội ngũ y b&aacute;c sĩ chuy&ecirc;n nghiệp</p>\r\n</div>\r\n<p>B&ecirc;n cạnh kh&ocirc;ng gian tho&aacute;ng đ&atilde;ng rộng r&atilde;i, Trung t&acirc;m dịch vụ Spa cũng ch&uacute; trọng v&agrave;o những dịch vụ l&agrave;m đẹp đem lại trải nghiệm thư gi&atilde;n v&agrave; hiệu quả cao như:&nbsp;</p>\r\n<ul>\r\n<li>Chăm s&oacute;c da cơ bản</li>\r\n<li>Chăm s&oacute;c da chuy&ecirc;n s&acirc;u</li>\r\n<li>L&agrave;m sạch da đa tầng Aqua pell</li>\r\n<li>Tiếp nước, vitamin tổng hợp ổn định l&agrave;n da sau tổn thương, da nhạy cảm thiếu nước, da kh&ocirc;</li>\r\n<li>Mặt trắng (cung cấp dưỡng chất l&agrave;m căng b&oacute;ng tươi mới l&agrave;n da)</li>\r\n<li>Trị liệu n&acirc;ng cơ chống l&atilde;o h&oacute;a Ultherapy</li>\r\n<li>Tonning 4G trẻ h&oacute;a trắng s&aacute;ng đồng đều da</li>\r\n<li>Than cacbon x&oacute;a nhăn mờ sẹo kiềm dầu thu nhỏ lỗ ch&acirc;n l&ocirc;ng</li>\r\n<li>Therma 4.0 trẻ h&oacute;a n&acirc;ng cơ</li>\r\n<li>Cấy tinh chất căng b&oacute;ng DHA</li>\r\n<li>Cấy tinh chất trị n&aacute;m, ức chế sắc tố</li>\r\n<li>&hellip;</li>\r\n</ul>\r\n<h2>Kh&ocirc;ng gian trải nghiệm thoải m&aacute;i đẳng cấp&nbsp;</h2>\r\n<p>C&aacute;c cơ sở vật chất, kh&ocirc;ng gian trong v&agrave; ngo&agrave;i của Kul Spa lu&ocirc;n được ch&uacute; trọng đến từng chi tiết nhỏ, tạo n&ecirc;n sự kh&aacute;c biệt về đẳng cấp sang trọng. Về trang thiết bị m&aacute;y m&oacute;c v&agrave; c&ocirc;ng nghệ, Kul Spa sẽ lu&ocirc;n cập nhật những d&ograve;ng c&ocirc;ng nghệ mới, ti&ecirc;n tiến nhất nhằm mang lại hiệu quả tốt nhất cho qu&yacute; Kh&aacute;ch h&agrave;ng.&nbsp;</p>\r\n<p><img class=\"aligncenter wp-image-4325 size-full\" title=\"Cơ sở vật chất hiện đại\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/Co-so-vat-chat-hien-dai.jpg\" alt=\"Cơ sở vật chất hiện đại \" width=\"600\" height=\"400\" /></p>\r\n<p><img class=\"aligncenter wp-image-4326 size-full\" title=\"Cơ sở vật chất v&agrave; dịch vụ đẳng cấp của KUL SPA\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/Co-so-vat-chat-va-dich-vu-dang-cap-cua-KUL-SPA.jpg\" alt=\"Cơ sở vật chất v&agrave; dịch vụ đẳng cấp của KUL SPA \" width=\"600\" height=\"400\" /></p>\r\n<p><img class=\"aligncenter wp-image-4327 size-full\" title=\"Trải nghiệm kh&ocirc;ng gian với cơ sở vật chất hiện đại\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/Trai-nghiem-khong-gian-voi-co-so-vat-chat-hien-dai.jpg\" alt=\"Trải nghiệm kh&ocirc;ng gian với cơ sở vật chất hiện đại \" width=\"600\" height=\"400\" /></p>\r\n<div id=\"attachment_4328\" class=\"wp-caption aligncenter\"><img class=\"wp-image-4328 size-full\" title=\"Thiết bị m&aacute;y m&oacute;c chăm s&oacute;c da hiện đại\" src=\"https://dautunhatnam.vn/wp-content/uploads/2022/03/Thiet-bi-may-moc-cham-soc-da-hien-dai.jpg\" alt=\"Thiết bị m&aacute;y m&oacute;c chăm s&oacute;c da hiện đại\" width=\"600\" height=\"400\" />\r\n<p id=\"caption-attachment-4328\" class=\"wp-caption-text\">Thiết bị m&aacute;y m&oacute;c chăm s&oacute;c da hiện đại</p>\r\n</div>\r\n<p>Kh&ocirc;ng ngừng nỗ lực ph&aacute;t triển, g&acirc;y dựng n&ecirc;n thương hiệu trong nhiều ng&agrave;nh từ đầu tư, kinh doanh v&agrave; quản l&yacute; bất động sản, giờ đ&acirc;y c&agrave;ng nổi trội hơn khi bắt đầu mở rộng sang lĩnh vực l&agrave;m đẹp.&nbsp;</p>\r\n<p>Định hướng ph&aacute;t triển th&agrave;nh cơ sở chăm s&oacute;c sắc đẹp bậc nhất, đạt ti&ecirc;u chuẩn dịch vụ 5 sao. KUL SPA định hướng th&uacute;c đẩy c&aacute;c kh&acirc;u từ thăm kh&aacute;m, tư vấn v&agrave; chăm s&oacute;c kh&aacute;ch h&agrave;ng đến thực hiện dịch vụ ng&agrave;y một vững chắc hơn tr&ecirc;n bước đường khẳng định thương hiệu SPA của Nhật Nam trong l&ograve;ng kh&aacute;ch h&agrave;ng. Tất cả với mong muốn đem đến trải nghiệm dịch vụ tốt nhất khi đến với Trung t&acirc;m.&nbsp;</p>\r\n<p>C&ocirc;ng ty Nhật Nam hy vọng sẽ lu&ocirc;n được đồng h&agrave;nh v&agrave; tạo ra nhiều gi&aacute; trị cho kh&aacute;ch h&agrave;ng, hơn ai hết ch&uacute;ng t&ocirc;i sẽ kh&ocirc;ng ngừng nỗ lực, lắng nghe &yacute; kiến đ&oacute;ng g&oacute;p từ qu&yacute; kh&aacute;ch để ho&agrave;n thiện v&agrave; x&acirc;y dựng thương hiệu độc quyền cho ri&ecirc;ng m&igrave;nh.&nbsp;</p>\r\n</body>\r\n</html>', 0, 1, 1, '', 'nhat-nam-chinh-thuc-ra-mat-dich-vu-spa', 'Nhật Nam chính thức ra mắt dịch vụ Spa', 'Nhật Nam chính thức ra mắt dịch vụ Spa', 'Nhật Nam chính thức ra mắt dịch vụ Spa', 'http://demo.local/uploads/vinateks_outsource_chungkhoan/avatar/2022-03-30/Doi-ngu-bac-si-cua-Trung-tam-chuyen-nghiep.jpeg', '', 1648614447, 0, 0);
INSERT INTO `news` (`id`, `title`, `short_description`, `description`, `news_category_id`, `news_type_id`, `news_group_id`, `link`, `link_url`, `meta_title`, `meta_description`, `meta_keyword`, `avatar`, `image`, `created_at`, `is_hidden`, `deleted`) VALUES
(9, 'BĐS Nhật Nam – Mừng Hội Nghị Tổng Công ty', 'Bất Động Sản Nhật Nam thông báo: Chương trình mua gói đầu tư chào đón nhân dịp Đại Hội Nghị Tổng Công Ty – tặng phiếu bốc thăm trúng thưởng hàng loạt giải thưởng giá trị – giải ô tô VINFAST áp dụng từ ngày 01/03/2022 đến hết ngày 13/03/2022.', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p><strong>Đại Hội Nghị Tổng C&ocirc;ng Ty &ndash; Bốc thăm TR&Uacute;NG THƯỞNG &Ocirc; T&Ocirc; VINFAST</strong></p>\r\n<p><em><strong>Bất Động Sản Nhật Nam th&ocirc;ng b&aacute;o: Chương tr&igrave;nh mua g&oacute;i đầu tư ch&agrave;o đ&oacute;n nh&acirc;n dịp Đại Hội Nghị Tổng C&ocirc;ng Ty &ndash; tặng phiếu bốc thăm tr&uacute;ng thưởng h&agrave;ng loạt giải thưởng gi&aacute; trị &ndash; giải &ocirc; t&ocirc; VINFAST &aacute;p dụng từ ng&agrave;y 01/03/2022 đến hết ng&agrave;y 13/03/2022.</strong></em></p>\r\n<p>Để đ&aacute;p lại sự tin tưởng v&agrave; ủng hộ của Qu&yacute; nh&agrave; đầu tư tr&ecirc;n to&agrave;n quốc, nh&acirc;n dịp Đại Hội Nghị Tổng C&ocirc;ng Ty , Bất Động Sản Nhật Nam tr&acirc;n trọng gửi đến to&agrave;n thể Qu&yacute; kh&aacute;ch h&agrave;ng chương tr&igrave;nh tặng phiếu Bốc thăm tr&uacute;ng thưởng cho nh&agrave; đầu tư khi tham gia hợp t&aacute;c đầu tư c&ugrave;ng bất động sản Nhật Nam (Chương tr&igrave;nh &aacute;p dụng từ ng&agrave;y 01/03/2022 đến hết ng&agrave;y 13/03/2022)</p>\r\n<p><strong><em>Nội dung chi tiết như sau:</em></strong></p>\r\n<p>Lưu &yacute; : Chương tr&igrave;nh Tặng phiếu bốc thăm tr&uacute;ng thưởng d&agrave;nh cho c&aacute;c g&oacute;i đầu tư từ 100.000.000 VND trở l&ecirc;n.</p>\r\n<div id=\"attachment_7104\" class=\"wp-caption aligncenter\"><img class=\"wp-image-7104\" title=\"Chương tr&igrave;nh bốc thăm tr&uacute;ng thưởng - Đại hội nghị tổng c&ocirc;ng ty\" src=\"https://dautunhatnam.com.vn/wp-content/uploads/2022/03/Chuong-trinh-boc-tham-trung-thuong-Dai-hoi-nghi-tong-cong-ty.png\" alt=\"Chương tr&igrave;nh bốc thăm tr&uacute;ng thưởng - Đại hội nghị tổng c&ocirc;ng ty\" width=\"600\" height=\"400\" />\r\n<p id=\"caption-attachment-7104\" class=\"wp-caption-text\">Chương tr&igrave;nh bốc thăm tr&uacute;ng thưởng &ndash; Đại hội nghị tổng c&ocirc;ng ty</p>\r\n</div>\r\n<p>B&ecirc;n cạnh chương tr&igrave;nh đầu tư &ndash; tặng phiếu bốc thăm tr&uacute;ng thưởng, Nhật Nam c&ograve;n song song tổ chức h&agrave;ng loạt c&aacute;c chương tr&igrave;nh ưu đ&atilde;i hấp dẫn kh&aacute;c, qu&yacute; kh&aacute;ch h&agrave;ng c&oacute; thể tham gia đầu tư v&agrave; lựa chọn để đem về những quyền lợi tốt nhất cho m&igrave;nh.&nbsp;</p>\r\n<p>Chương tr&igrave;nh d&agrave;nh thưởng cho kh&aacute;ch h&agrave;ng tham gia hợp t&aacute;c c&ugrave;ng Nhật Nam, ph&acirc;n chia lợi nhuận 8%.&nbsp;</p>\r\n<p><img class=\"aligncenter wp-image-7107\" title=\"Cơ hội hợp t&aacute;c si&ecirc;u lợi nhuận ch&agrave;o mừng đại hội tổng c&ocirc;ng ty\" src=\"https://dautunhatnam.com.vn/wp-content/uploads/2022/03/co-hoi-hop-tac-sieu-loi-nhuan-chao-mung-dai-hoi-tong-cong-ty.jpg\" alt=\"cơ hội hợp t&aacute;c si&ecirc;u lợi nhuận ch&agrave;o mừng đại hội tổng c&ocirc;ng ty\" width=\"600\" height=\"406\" /></p>\r\n<p>Đặc biệt, nh&acirc;n dịp Đại Hội Nghị C&ocirc;ng Ty, Bất Động Sản Nhật Nam th&agrave;nh lập C&acirc;u Lạc Bộ Doanh Nh&acirc;n để gi&uacute;p c&aacute;c th&agrave;nh vi&ecirc;n khi tham gia c&oacute; được m&ocirc;i trường giao lưu sinh hoạt bổ &iacute;ch, l&agrave; nơi gặp gỡ của c&aacute;c doanh nh&acirc;n.&nbsp;</p>\r\n<p>Khi kh&aacute;ch h&agrave;ng k&yacute; hợp đồng hợp t&aacute;c kinh doanh với mức 3.000.000.000 VND v&agrave; 5.000.000.000 VND, ngo&agrave;i việc được ph&acirc;n chia lợi nhuận như quy định trong phụ lục hợp đồng v&agrave; nhận về phiếu bốc thăm tr&uacute;ng thưởng, c&ocirc;ng ty c&ograve;n cấp giấy chứng nhận kh&aacute;ch h&agrave;ng l&agrave; th&agrave;nh vi&ecirc;n C&acirc;u Lạc Bộ Doanh Nh&acirc;n Nhật Nam.&nbsp;</p>\r\n<p>Thời gian nhận th&agrave;nh vi&ecirc;n từ ng&agrave;y 01/03/2022 đến hết ng&agrave;y 15/03/2022.</p>\r\n<p>Ngo&agrave;i ra nh&agrave; đầu tư c&ograve;n được hưởng rất nhiều c&aacute;c ưu đ&atilde;i kh&aacute;c:</p>\r\n<p>&ndash; Ph&acirc;n chia lợi nhuận trực tiếp qua ATM mỗi ng&agrave;y</p>\r\n<p>&ndash; Hợp đồng minh bạch, r&otilde; r&agrave;ng theo ti&ecirc;u chuẩn ph&aacute;p luật</p>\r\n<p>Đầu năm 2022 được coi l&agrave; cơ hội tốt để kh&aacute;ch h&agrave;ng bắt đầu với k&ecirc;nh đầu tư mới. Nhật Nam &ndash; tự h&agrave;o l&agrave; thương hiệu đầu tư h&agrave;ng đầu với những yếu tố đảm bảo d&agrave;nh cho nh&agrave; đầu tư. Nhật Nam sở hữu đầy đủ tất cả c&aacute;c yếu tố: Yếu tố ph&aacute;p l&yacute; đảm bảo t&iacute;nh an to&agrave;n t&agrave;i ch&iacute;nh, uy t&iacute;n, tiềm lực mạnh, vị tr&iacute;, loại h&igrave;nh v&agrave; lợi nhuận.</p>\r\n<p><em><strong>Đầu tư Nhật Nam- K&ecirc;nh đầu tư vững v&agrave;ng năm th&aacute;ng.</strong></em></p>\r\n</body>\r\n</html>', 0, 1, 1, '', 'bds-nhat-nam-–-mung-hoi-nghi-tong-cong-ty', 'BĐS Nhật Nam – Mừng Hội Nghị Tổng Công ty', 'BĐS Nhật Nam – Mừng Hội Nghị Tổng Công ty', 'BĐS Nhật Nam – Mừng Hội Nghị Tổng Công ty', 'http://demo.local/uploads/vinateks_outsource_chungkhoan/avatar/2022-03-30/Chuong-trinh-boc-tham-trung-thuong-Dai-hoi-nghi-tong-cong-ty_1.png', '', 1648614881, 0, 0),
(10, 'Thông báo kết nạp thành viên CLB Doanh Nhân Nhật Nam', 'Hưởng ứng tháng hợp tác và phát triển cùng Nhật Nam, tới đây công ty BĐS Nhật Nam mở rộng, kết nạp thành viên CLB Doanh nhân với mục đích giao lưu, sinh hoạt bổ ích, tạo môi trường gặp gỡ đối với những doanh nhân thành công trên mọi miền tổ quốc. ', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Hưởng ứng th&aacute;ng hợp t&aacute;c v&agrave; ph&aacute;t triển c&ugrave;ng Nhật Nam, tới đ&acirc;y c&ocirc;ng ty BĐS Nhật Nam mở rộng, kết nạp th&agrave;nh vi&ecirc;n CLB Doanh nh&acirc;n với mục đ&iacute;ch giao lưu, sinh hoạt bổ &iacute;ch, tạo m&ocirc;i trường gặp gỡ đối với những doanh nh&acirc;n th&agrave;nh c&ocirc;ng tr&ecirc;n mọi miền tổ quốc.&nbsp;</p>\r\n<p>Ưu đ&atilde;i d&agrave;nh cho c&aacute;c cổ đ&ocirc;ng khi tham gia k&yacute; kết hợp đồng, b&ecirc;n cạnh việc ph&acirc;n chia lợi nhuận theo như quy định, C&ocirc;ng ty c&ograve;n cấp Giấy chứng nhận kh&aacute;ch h&agrave;ng l&agrave;m th&agrave;nh vi&ecirc;n CLB Doanh nh&acirc;n với mức hợp t&aacute;c được quy định như sau:</p>\r\n<ul>\r\n<li>Mức hợp t&aacute;c tham gia:&nbsp;<strong>3 tỷ đồng</strong></li>\r\n</ul>\r\n<p>Cơ hội nhận 2 v&eacute; khứ hồi du lịch tại Ph&uacute; Quốc, đồng thời hưởng quỹ tự do t&agrave;i ch&iacute;nh 5.000.000 đồng li&ecirc;n tục trong v&ograve;ng 10 năm.&nbsp;&nbsp;</p>\r\n<ul>\r\n<li>Mức hợp t&aacute;c tham gia:&nbsp;<strong>5 tỷ đồng&nbsp;</strong></li>\r\n</ul>\r\n<p>Cơ hội nhận 4 v&eacute; khứ hồi du lịch Ph&uacute; Quốc, đồng thời hưởng quỹ tự do t&agrave;i ch&iacute;nh 10.000.000 đồng li&ecirc;n tục trong v&ograve;ng 10 năm.&nbsp;</p>\r\n<div id=\"attachment_7053\" class=\"wp-caption aligncenter\"><img class=\"wp-image-7053 size-full\" title=\"Th&ocirc;ng b&aacute;o kết nạp th&agrave;nh vi&ecirc;n CLB Doanh nh&acirc;n\" src=\"https://dautunhatnam.com.vn/wp-content/uploads/2022/02/Thong-bao-ket-nap-thanh-vien-CLB-Doanh-nhan.jpg\" alt=\"Th&ocirc;ng b&aacute;o kết nạp th&agrave;nh vi&ecirc;n CLB Doanh nh&acirc;n\" width=\"896\" height=\"1280\" />\r\n<p id=\"caption-attachment-7053\" class=\"wp-caption-text\">Th&ocirc;ng b&aacute;o kết nạp th&agrave;nh vi&ecirc;n CLB Doanh nh&acirc;n C&ocirc;ng ty BĐS Nhật Nam</p>\r\n</div>\r\n<p>C&ugrave;ng với những cột mốc, th&agrave;nh tựu m&agrave; Nhật Nam đạt được, CLB Doanh nh&acirc;n Nhật Nam đang ng&agrave;y c&agrave;ng trở n&ecirc;n vững mạnh, khẳng định vị thế của m&igrave;nh khi nhận được những lời mời gọi hợp t&aacute;c, kết nối kinh doanh từ nhiều doanh nh&acirc;n tr&ecirc;n khắp cả nước.&nbsp;&nbsp;</p>\r\n</body>\r\n</html>', 0, 1, 1, '', 'thong-bao-ket-nap-thanh-vien-clb-doanh-nhan-nhat-nam', 'Thông báo kết nạp thành viên CLB Doanh Nhân Nhật Nam', 'Thông báo kết nạp thành viên CLB Doanh Nhân Nhật Nam', 'Thông báo kết nạp thành viên CLB Doanh Nhân Nhật Nam', 'http://demo.local/uploads/vinateks_outsource_chungkhoan/avatar/2022-03-30/Thong-bao-ket-nap-thanh-vien-CLB-Doanh-nhan.jpeg', '', 1648614974, 0, 0),
(11, 'Test', 'Test', '<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Test</p>\r\n</body>\r\n</html>', 0, 1, 0, '', 'test', 'Test', 'Test', 'Test', '', '', 1649146846, 1, 1649146876);
INSERT INTO `news1` (`id`, `title`, `long_title`, `description`, `views`, `_date`, `_img`) VALUES
(1, 'Bản thiết kế vĩ đại Samsung Odyssey OLED G9 Gaming đã lộ diện', 'Samsung cuối cùng đã cho lên kệ bản thiết kế vĩ đại và được giới công nghệ mong đợi nhất từ trước đến nay - Samsung Odyssey OLED G9 Gaming sau khoảng một khoảng thời gian dài tung hint. Cùng tìm hiểu xem chiếc màn hình này có tinh hoa gì không nhé!', '<div class=\"article-pages p3\">\n							<p style=\"text-align: justify;\"><em><strong><span style=\"font-size:18px;\">Samsung cuối cùng đã cho lên kệ bản thiết kế vĩ đại và được giới công nghệ mong đợi nhất từ trước đến nay - Samsung Odyssey OLED G9 Gaming sau khoảng một khoảng thời gian dài tung hint. Cùng tìm hiểu xem chiếc màn hình này có tinh hoa gì không nhé!</span></strong></em></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Đầu tiên, <a target=\"_blank\" href=\"https://gearvn.com/products/man-hinh-cong-samsung-odyssey-neo-g9-ls49ag950-49-va-2k-240hz-gsync\">Samsung Odyssey</a> OLED G9 Gaming là một trong những model <a target=\"_blank\" href=\"https://gearvn.com/collections/man-hinh-tu-5-den-10-trieu\">màn hình gaming</a> “độc nhất” và “đỉnh nhất” từ trước đến nay. Màn hình được trang bị kích thước màn hình 49 inch Dual QHD, tần số quét 5120 x 1440, tỷ lệ màn hình mới 32:9 với độ cong màn hình lý tưởng 1800R để bạn có thể thực sự đắm chìm trong thế giới riêng của mình. Hơn nữa, để nâng cao trải nghiệm chơi game cho người dùng, ông lớn công nghệ từ xứ sở củ sâm còn sở hữu tần số quét <a target=\"_blank\" href=\"https://gearvn.com/collections/man-hinh-240hz\">240Hz</a> và thời gian phản hồi 0,03ms giúp bạn đón đầu mọi hành động của kẻ thù và chiếm thế thượng phong trong mọi trò chơi.</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Bản thiết kế vĩ đại Samsung Odyssey OLED G9 Gaming đã lên kệ\" src=\"//file.hstatic.net/1000026716/file/gearvn-samsung-odyssey-oled-g9-gaming-2_801d62e7c27044f1a496fae8a8a5204b_1024x1024.png\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Samsung Odyssey OLED G9 Gaming còn mang trong mình công nghệ AMD Freesync Pro cao cấp, hỗ trợ và cung cấp hiệu suất một cách tối ưu và trải nghiệm chơi game mượt mà. Bạn hoàn toàn không phải bắt gặp những tình trạng khó chịu như <a target=\"_blank\" href=\"https://gearvn.com/blogs/thu-thuat-giai-dap/xe-man-hinh-la-gi\">xé màn hình</a>, hiện tượng bóng ma,...làm ảnh hưởng đến trải nghiệm chơi game của bạn. Bên cạnh đó, <a target=\"_blank\" href=\"https://gearvn.com/collections/man-hinh-samsung\">màn hình Samsung</a> chuyên game này còn đi kèm với VESA Display HDR True Black 400 certification và HDR10+ mang đến khả năng tái tạo hình ảnh chân thật, sống động, sắc đen sâu và độ tương phản rõ rệt. Đây rõ ràng là một bản thiết kế vĩ đại, tinh hóa hội tụ, game thủ&nbsp;rất yêu!</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Bản thiết kế vĩ đại Samsung Odyssey OLED G9 Gaming đã lên kệ\" src=\"//file.hstatic.net/1000026716/file/gearvn-samsung-odyssey-oled-g9-gaming-3_884bc036d9ae46898508dc45edc9afad_1024x1024.png\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Samsung Odyssey OLED G9 Gaming đi kèm với con chip Neo Quantum Processor Pro mới nhất của Samsung cùng với Samsung Gaming Hub mới nhất hỗ trợ <a target=\"_blank\" href=\"https://gearvn.com/blogs/thu-thuat-giai-dap/xbox-game-pass\">Xbox Game Pass</a> và NVIDIA GeForce Now. Tính năng mới này cho phép người dùng truy cập với tất tần tật các loại game hiện này mà không cần kết nối thiết bị ngoại vi khác như <a target=\"_blank\" href=\"https://gearvn.com/pages/pc-gvn\">PC</a>,&nbsp;<a target=\"_blank\" href=\"https://gearvn.com/collections/laptop\">laptop</a>&nbsp;hay điện thoại di động.</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Bản thiết kế vĩ đại Samsung Odyssey OLED G9 Gaming đã lên kệ\" src=\"//file.hstatic.net/1000026716/file/gearvn-samsung-odyssey-oled-g9-gaming-4_d18708246a5042a583644a5781b740ac_1024x1024.png\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Samsung Odyssey series từ trước đến nay luôn được biết đến là series <a target=\"_blank\" href=\"https://gearvn.com/pages/man-hinh\">màn hình máy tính</a> sở hữu thiết kế đầy tính thẩm mỹ, và đương nhiên Samsung Odyssey OLED G9 Gaming cũng không ngoại lệ. Khoác lên mình bộ áo trắng tinh tế, cách điệu với đường viền đen độc đáo trong bộ khung kim loại bóng bẩy. Và điểm ăn tiền trong thiết kế vẫn chính là vòng tròn RGB ở trung tâm mặt sau, hỗ trợ CoreSync và Core Lightning+ để bạn thoải mái đồng bồ với hệ thống ánh sáng trên màn hình.</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Với một tuyệt tác như thế, Samsung Odyssey OLED G9 Gaming vẫn chưa được công bố giá bán chính thức. Tuy nhiên, bạn đã có thể chính thức pre-order siêu phẩm này. Bạn cảm thấy siêu phẩm mới này của nhà Samsung như thế nào. Bạn có muốn sở hữu cho mình một siêu phẩm màn hình rộng như thế không?</span></p>\n						</div>\nGEARVN - Bản thiết kế vĩ đại Samsung Odyssey OLED G9 Gaming đã lên kệ\n\nSamsung Odyssey OLED G9 Gaming còn mang trong mình công nghệ AMD Freesync Pro cao cấp, hỗ trợ và cung cấp hiệu suất một cách tối ưu và trải nghiệm chơi game mượt mà. Bạn hoàn toàn không phải bắt gặp những tình trạng khó chịu như xé màn hình, hiện tượng bóng ma,...làm ảnh hưởng đến trải nghiệm chơi game của bạn. Bên cạnh đó, màn hình Samsung chuyên game này còn đi kèm với VESA Display HDR True Black 400 certification và HDR10+ mang đến khả năng tái tạo hình ảnh chân thật, sống động, sắc đen sâu và độ tương phản rõ rệt. Đây rõ ràng là một bản thiết kế vĩ đại, tinh hóa hội tụ, game thủ rất yêu!\n\nGEARVN - Bản thiết kế vĩ đại Samsung Odyssey OLED G9 Gaming đã lên kệ\n\nSamsung Odyssey OLED G9 Gaming đi kèm với con chip Neo Quantum Processor Pro mới nhất của Samsung cùng với Samsung Gaming Hub mới nhất hỗ trợ Xbox Game Pass và NVIDIA GeForce Now. Tính năng mới này cho phép người dùng truy cập với tất tần tật các loại game hiện này mà không cần kết nối thiết bị ngoại vi khác như PC, laptop hay điện thoại di động.\n\nGEARVN - Bản thiết kế vĩ đại Samsung Odyssey OLED G9 Gaming đã lên kệ\n\nSamsung Odyssey series từ trước đến nay luôn được biết đến là series màn hình máy tính sở hữu thiết kế đầy tính thẩm mỹ, và đương nhiên Samsung Odyssey OLED G9 Gaming cũng không ngoại lệ. Khoác lên mình bộ áo trắng tinh tế, cách điệu với đường viền đen độc đáo trong bộ khung kim loại bóng bẩy. Và điểm ăn tiền trong thiết kế vẫn chính là vòng tròn RGB ở trung tâm mặt sau, hỗ trợ CoreSync và Core Lightning+ để bạn thoải mái đồng bồ với hệ thống ánh sáng trên màn hình.\n\nVới một tuyệt tác như thế, Samsung Odyssey OLED G9 Gaming vẫn chưa được công bố giá bán chính thức. Tuy nhiên, bạn đã có thể chính thức pre-order siêu phẩm này. Bạn cảm thấy siêu phẩm mới này của nhà Samsung như thế nào. Bạn có muốn sở hữu cho mình một siêu phẩm màn hình rộng như thế không?', 8, '2023-07-13', 'img.jpg'),
(2, '[Lenovo Innovate] Lenovo ra mắt loạt laptop, màn hình cao cấp', 'Ngày 6/6/2023, Lenovo đã trình làng loạt sản phẩm laptop mới trong sự kiện Lenovo Innovate. Mang đến nhiều sản phẩm cao cấp với nhiều cải tiến hơn về hiệu suất, thiết kế, tản nhiệt,... với tôn chỉ đem lại sản phẩm có trải nghiệm tốt nhất cho mọi nhu cầu khách hàng khác nhau trên thị trường. Cùng GEARVN điểm qua một vài thông tin hữu ích trong sự kiện Lenovo Innovate vừa qua nhé! ', '<div class=\"article-pages p3\">\n							<p style=\"text-align: justify;\"><em><span style=\"font-size:18px;\">Ngày 6/6/2023, Lenovo đã trình làng loạt sản phẩm laptop mới trong sự kiện Lenovo Innovate. Mang đến nhiều sản phẩm cao cấp với nhiều cải tiến hơn về hiệu suất, thiết kế, tản nhiệt,... với tôn chỉ đem lại sản phẩm có trải nghiệm tốt nhất cho mọi nhu cầu khách hàng khác nhau trên thị trường. Cùng GEARVN điểm qua một vài thông tin hữu ích trong sự kiện Lenovo Innovate vừa qua nhé!&nbsp;</span></em></p><blockquote><p style=\"text-align: justify;\"><em><span style=\"font-size:18px;\"><strong>Theo ông Woraphot Thavornwan (Giám đốc kinh doanh Consumer khu vực Trung Á Thái Bình Dương) chia sẻ:</strong> “Giới trẻ hiện nay thường có xu hướng theo phong cách hybrid kết hợp giữa làm việc và giải trí. Và Lenovo luôn lấy nhu cầu của khách hàng làm động lực để phát triển nhiều sản phẩm tân tiến hơn giúp họ giải quyết được mọi vấn đề. Bứt phá giới hạn trải nghiệm mọi lúc, mọi nơi với nhiều thiết bị sáng tạo được trang bị công nghệ thông minh”.</span></em></p></blockquote><p style=\"text-align: center\"><img alt=\"GEARVN - Lenovo Innovate ngày 6/6/2023\" src=\"//file.hstatic.net/1000026716/file/gearvn-lenovo-innovate-lenovo-ra-mat-loat-laptop-man-hinh-cao-cap-10_870e1828ea594e3c852a3c86a0033756_1024x1024.jpg\"></p><h2 style=\"text-align: justify;\"><strong><span style=\"font-size:22px;\">Dòng sản phẩm laptop Lenovo Legion</span></strong></h2><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Bên cạnh các giới thiệu về sản phẩm dòng Legion như Lenovo Legion Pro 7i, Legion Pro 5/5i, Legion Slim 7i hay Legion Slim 5/5i nhà Lenovo cũng giới thiệu cái tên mới trong phân khúc <a target=\"_blank\" href=\"https://gearvn.com/pages/laptop-gaming\">laptop gaming</a> tầm trung là Lenovo LOQ.&nbsp;</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Giới thiệu dòng laptop Lenovo Legion tại sự kiện Lenovo Innovate\" src=\"//file.hstatic.net/1000026716/file/gearvn-lenovo-innovate-lenovo-ra-mat-loat-laptop-man-hinh-cao-cap-8_7da8564754de4e939215391432695136_1024x1024.jpg\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Lenovo LOQ được giới thiệu như một đàn em tiền nhiệm của dòng laptop gaming cao cấp <a target=\"_blank\" href=\"https://gearvn.com/collections/laptop-lenovo-legion\">Lenovo Legion</a>. Với sự cân chỉnh hợp lý về cấu hình, bộ tản nhiệt và các công nghệ hiện đại đi kèm để mang đến dòng laptop có mức giá dễ tiếp cận người tiêu dùng hơn. Cùng với sự trang bị Lenovo AI Engine+ như một cuộc cách mạng đổi mới trong việc tăng cường hiệu suất tốt hơn khi vận hành các ứng dụng. Đồng hành cùng con chip Lenovo LA1 AI tiên tiến để điều chỉnh các thông số khi chơi game một cách tối ưu hơn.&nbsp;</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Giới thiệu dòng laptop Lenovo LOQ mới tại sự kiện Lenovo Innovate\" src=\"//file.hstatic.net/1000026716/file/gearvn-lenovo-innovate-lenovo-ra-mat-loat-laptop-man-hinh-cao-cap-3_9e8ea1d869bd460ab7236659c20f6c50_1024x1024.jpg\"></p><h2 style=\"text-align: justify;\"><strong><span style=\"font-size:22px;\">Dòng sản phẩm laptop Lenovo Yoga</span></strong></h2><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Các sản phẩm dòng Yoga cũng được mang đến trong buổi ra mắt tại Lenovo Innovate. Bao gồm các mẫu Yoga Pro, Yoga Slim và Yoga 2in1 cao cấp.&nbsp;</span><span style=\"font-size:18px;\">Với cải tiến về thiết kế bo tròn tinh tế, sử dụng vật liệu nhôm tái chế thân thiện với môi trường, được chứng nhận độ bền chuẩn quân đội MIL-STD 810H. Với công nghệ Lenovo X Power hỗ trợ thế hệ Yoga mới tăng cường hiệu suất với khả năng làm mát cho CPU, GPU, RAM và SSD tốt hơn. Đưa đến giải pháp làm mát với kích thước quạt tản nhiệt và ống dẫn nhiệt lớn hơn. Bên cạnh nhà Lenovo cũng trang bị Lenovo AI Engine+ để phục vụ cho các công việc đồ họa 2D, 3D, dựng video.&nbsp;</span></p><p style=\"text-align: justify;\"><img alt=\"GEARVN - Giới thiệu dòng laptop Lenovo Yoga tại sự kiện Lenovo Innovate\" src=\"//file.hstatic.net/1000026716/file/gearvn-lenovo-innovate-lenovo-ra-mat-loat-laptop-man-hinh-cao-cap-7_40fc77b59f9344efbe565c0e7acfe33b_1024x1024.jpg\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">“Hoa hậu” trong buổi ra mắt chính là chiếc laptop 2in1 Lenovo Yoga Book 9i. Đây là chiếc <a target=\"_blank\" href=\"https://gearvn.com/collections/laptop\">laptop</a> 2 màn hình OLED đầu tiên trên thế giới với nhiều chế độ sử dụng như:</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong>• Scroll Mode:</strong> Mở rộng tầm nhìn cho nhu cầu hiển thị nhiều nội dung hơn.&nbsp;</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong>• Book Mode:</strong> Biến thành chế độ cuốn sách để làm việc trên 2 màn hình.</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong>• Tent Mode:</strong> Chế độ lều để bạn có thể vừa làm việc trên laptop vừa có thể chia sẻ các thông tin ở màn hình còn lại với người đối diện dễ dàng.</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong>• Dual Tablet:</strong> Gập màn hình 360 độ là có ngay chiếc máy tính bảng với mặt trước và mặt sau là màn hình cảm ứng.&nbsp;</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong>• Laptop Mode:</strong> Chế độ máy tính xách tay thông thường.</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Các chế độ của laptop Lenovo Yoga Book 9i\" src=\"//file.hstatic.net/1000026716/file/gearvn-lenovo-innovate-lenovo-ra-mat-loat-laptop-man-hinh-cao-cap-5_f06478feaf4340cbbdbdb43eff5c0c56_1024x1024.png\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Vẫn ưu tiên chọn chất liệu thân thiện với môi trường như nhôm tái chế để làm nên lớp vỏ máy tính. Điều đó như ngầm thể hiện một thông điệp rằng “sở hữu Yoga Book 9i để có một chiếc laptop không chỉ tốt cho bạn mà còn tốt cho hành tinh này”. Cùng sự trang bị về hiệu suất xử lý từ con chip Intel 13th mạnh mẽ, khả năng hiển thị hình ảnh tốt với Dual PureSight PLED để hỗ trợ công việc tối đa của người tiêu dùng. Hứa hẹn sẽ là dòng laptop cao cấp được săn đón trong thời gian sắp tới.&nbsp;</span></p><p style=\"text-align: justify;\"><img alt=\"GEARVN - Giới thiệu dòng laptop Lenovo Yoga Book 9i tại sự kiện Lenovo Innovate\" src=\"//file.hstatic.net/1000026716/file/gearvn-lenovo-innovate-lenovo-ra-mat-loat-laptop-man-hinh-cao-cap-6_034917b4ffc0436aaa73327a254abd9e_1024x1024.jpg\"></p><h2 style=\"text-align: justify;\"><strong><span style=\"font-size:22px;\">Dòng sản phẩm màn hình Lenovo</span></strong></h2><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Bên cạnh các ứng cử viên sáng giá là laptop, Lenovo cũng đã giới thiệu đến những chiếc màn hình trang bị công nghệ tiên tiến hơn.&nbsp;</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Với dòng <a target=\"_blank\" href=\"https://gearvn.com/collections/man-hinh-lenovo\">màn hình Lenovo</a> tiêu dùng có các dòng:&nbsp;</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">• <strong>D Series:</strong> Sử dụng tấm nền TN/VA, trang bị kết nối đa dạng VGA / HDMI / DP / Audio thông dụng, tự do tùy chỉnh góc nhìn, màn hình bảo vệ mắt.&nbsp;</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong>• L Series:</strong> Tấm nền VA/IPS, kết nối HDMI / VGA / Type-C / Audio out, 75Hz, kích thước từ 21.5inch - 27inch, phủ màu cao 99% sRGB, giảm ánh sáng xanh.</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong>• Q Series:</strong> Phân giải cao lên đến 2K (2560x1440), màu sắc chân thực với 99%sRGB và 90% DCI-P3, tương phản rộng HDR, tấm nền IPS, công nghệ Smart Crystal Audio</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Các dòng màn hình Lenovo\" src=\"//file.hstatic.net/1000026716/file/gearvn-lenovo-innovate-lenovo-ra-mat-loat-laptop-man-hinh-cao-cap-12_eab6f74e45f54f2186ec464c8f3f6aff_1024x1024.jpg\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Với dòng <a target=\"_blank\" href=\"https://gearvn.com/collections/man-hinh-di-dong\">màn hình&nbsp;di động</a> hứa hẹn sẽ là sản phẩm đồng hành cùng người dùng trên mọi nẻo đường học tập, công việc và giải trí. Thiết kế mỏng nhẹ với trọng lượng 0.86kg, kết nối USB-C nhanh chóng, linh hoạt điều chỉnh góc nhìn sẽ là cộng sự tuyệt vời. Bên cạnh việc mang đến một thiết kế màn hình hữu ích hãng cũng không quên bảo vệ sức khỏe người tiêu dùng với chứng nhận TUV Rheinland giảm ánh sáng xanh bảo vệ mắt.&nbsp;</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Màn hình di dộng Lenovo được trưng bày tại Lenovo Innovate\" src=\"//file.hstatic.net/1000026716/file/gearvn-lenovo-innovate-lenovo-ra-mat-loat-laptop-man-hinh-cao-cap-9_fa7f581c22bb48ce8a46d4935a398400_1024x1024.jpg\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Những chiếc <a target=\"_blank\" href=\"https://gearvn.com/collections/man-hinh-tu-5-den-10-trieu\">màn hình gaming</a> Y Series trang bị nhiều thông số hấp dẫn mọi game thủ sở hữu chúng. Độ phân giải cao FHD / QHD / UHD, phủ màu cao 99% sRGB, tần số quét lên đến 280Hz, phản hồi nhanh 0.5ms tái hiện chân thực từng chi tiết trong trò chơi. Bên cạnh đó còn trang bị phần mềm Artery đi kèm để việc điều chỉnh các hiển thị qua màn hình dễ dàng hơn.&nbsp;</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Màn hình gaming Lenovo\" src=\"//file.hstatic.net/1000026716/file/gearvn-lenovo-innovate-lenovo-ra-mat-loat-laptop-man-hinh-cao-cap-13_b7b4771515e4485f8d79d21b2a64d190_1024x1024.jpg\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Không chỉ vậy, hãng còn mang đến thông báo về chính sách bảo hành mới cực kỳ hấp dẫn cho người dùng khi mua sản phẩm <a target=\"_blank\" href=\"https://gearvn.com/pages/man-hinh\">màn hình</a> Lenovo. Quyết định bảo hành 1 đổi 1 tận nơi trong 3 năm cho màn hình để bàn có kích thước từ 23.8inch trở lên và màn hình di động kể từ ngày 01/06/2023.</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Và đó vài thông tin được GEARVN cập nhật từ sự kiện ra mắt Lenovo Innovate vừa qua. Bắt đầu cho thế hệ mới của các dòng sản phẩm sáng tạo hơn trên thị trường đáp ứng mọi nhu cầu của người tiêu dùng.</span></p>\n						</div>', 1, '2023-07-13', 'img.jpg'),
(3, '[Computex 2023] MSI trở lại với màn kết hợp mạnh mẽ cùng Mercedes-AMG', 'Computex 2023 đã trở lại với sự góp mặt của rất nhiều thương hiệu hàng đầu trong lĩnh vực máy tính, linh kiện, viễn thông và nhiều thiết bị công nghệ khác. Trong sự kiện đó không thể không nhắc đến màn kết hợp chấn động giữa MSI và Mercedes-AMG. Hàng loạt mẫu laptop ấn tượng đã ra mắt sau khoảng thời gian trì hoãn vì đại dịch vừa qua. Hãy cùng GEARVN điểm danh qua một vài thông tin hấp dẫn từ nhà Rồng nhé!', '<div class=\"article-pages p3\">\r\n							<p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Computex 2023 đã trở lại với sự góp mặt của rất nhiều thương hiệu hàng đầu trong lĩnh vực máy tính, linh kiện, viễn thông và nhiều thiết bị công nghệ khác. Trong sự kiện đó không thể không nhắc đến màn kết hợp chấn động giữa MSI và Mercedes-AMG. Hàng loạt mẫu laptop ấn tượng đã ra mắt sau khoảng thời gian trì hoãn vì đại dịch vừa qua. Hãy cùng GEARVN điểm danh qua một vài thông tin hấp dẫn từ nhà Rồng nhé!</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - [Computex 2023] MSI trở lại với màn kết hợp mạnh mẽ cùng Mercedes-AMG\" src=\"//file.hstatic.net/1000026716/file/-computex-2023-msi-tro-lai-voi-man-ket-hop-manh-me-cung-mercedes-amg-2_b381987c1ea84d7c824f1fc981aa25dd.png\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Những sản phẩm từ MSI luôn được đầu tư sản xuất với tôn chỉ về tính thẩm mỹ và cao cấp. Và lần này với sự trở lại trên đấu trường <a target=\"_blank\" href=\"https://gearvn.com/collections/laptop\">laptop</a>, nhà Rồng đã không làm các tín đồ đam mê công nghệ thất vọng với nhiều sản phẩm đầy sáng tạo. Tại Computex 2023, Creator Z17 HX Studio, Alpha 17, Prestige 16 mới nhất hay Commercial 14 đều được MSI chuẩn bị kỹ lưỡng trong màn tái xuất đầy ấn tượng lần này. Và không thể không kể đến sự xuất hiện nổi bật nhất là chiếc laptop gaming MSI phiên bản Mercedes.&nbsp;</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Laptop MSI Stealth 16 Mercedes-AMG Motorsport\" src=\"//file.hstatic.net/1000026716/file/-computex-2023-msi-tro-lai-voi-man-ket-hop-manh-me-cung-mercedes-amg-3_d9ae68ac98b74cf786a9582d800d2cb1.png\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">MSI Stealth 16 được ra đời tại sự kiện Computex 2023 với thiết kế được lấy cảm hứng từ mẫu xe đua Mercedes-AMG GT2. Chiếc laptop gaming cao cấp nhất từ trước đến nay của nhà Rồng với tên gọi là Stealth 16 Mercedes-AMG Motorsport.</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Ngoại hình máy được phủ một lớp màu xám Selenite đặc trưng của dòng xe Mercedes sẽ tạo nên một điểm thu hút ấn tượng của dòng <a target=\"_blank\" href=\"https://gearvn.com/pages/laptop-gaming\">laptop gaming</a> mới nhà MSI này. Sử dụng chất liệu hợp kim nhôm - magie cao cấp để vừa tạo nên sự sang trọng từ vẻ ngoài vừa tối ưu trọng lượng trên một thiết kế laptop chơi game 16inch.&nbsp;</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Laptop MSI Stealth 16 Mercedes-AMG Motorsport tại sự kiện Computex 2023\" src=\"//file.hstatic.net/1000026716/file/-computex-2023-msi-tro-lai-voi-man-ket-hop-manh-me-cung-mercedes-amg-8_c330abc73bf3414b98007e6117cd103c.jpg\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Cạnh sau của chiếc <a target=\"_blank\" href=\"https://gearvn.com/collections/laptop-msi-gaming\">laptop MSI</a> Stealth 16 Mercedes-AMG Motorsport là dòng chữ Stealth nổi bật. Lấy ý tưởng từ thiết kế đặc trưng của dòng xe thể thao Mercedes để áp dụng cho từng điểm nhấn trên mặt lưng, bàn phím mà chắc hẳn ai đam mê thể thao tốc độ đều sẽ nhận ra.</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Laptop MSI Stealth 16 Mercedes-AMG Motorsport tại sự kiện Computex 2023\" src=\"//file.hstatic.net/1000026716/file/-computex-2023-msi-tro-lai-voi-man-ket-hop-manh-me-cung-mercedes-amg-9_d296e3510cab433fa98fcaaf8618c6af.png\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Logo kết hợp giữa MSI và Mercedes-AMG được đặt ở mặt nắp máy tính cũng như phần cạnh dưới khu vực hiển thị màn hình. Phần loa đục lỗ theo chữ AMG với hệ thống 6 loa Dynaudio độc quyền trong việc phát ra những chất âm cực chất. Có nét tương đồng với bộ loa cao cấp Burmester trên xe thể thao Mercedes-AMG.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Laptop MSI Stealth 16 Mercedes-AMG Motorsport tại sự kiện Computex 2023\" src=\"//file.hstatic.net/1000026716/file/-computex-2023-msi-tro-lai-voi-man-ket-hop-manh-me-cung-mercedes-amg-4_0b3b845a86a14ff3a6ab0e11642e8f1c.png\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">MSI Stealth 16 Mercedes-AMG Motorsport sở hữu màn hình OLED 16 inch với độ phân giải cao UHD+ (3840x2400). Kết hợp cùng bộ vi xử lý Intel Core i9-13900H Gen 13 mạnh mẽ và card đồ họa NVIDIA RTX 40 để làm nên hiệu suất ấn tượng. Sẵn sàng mọi lời thách thức từ các yêu cầu xử lý khó nhằn trong công việc hay tải game cấu hình cao mọi lúc mọi nơi.&nbsp;</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Bên cạnh hiệu suất mạnh mẽ trên chiếc laptop MSI Stealth 16 hãng còn cung cấp nhiều giao diện kết nối phổ biến hiện nay. Gồm các cổng như USB Type-A, USB Type-C, HDMI, Thunderbolt 4, giắc tai nghe, cổng DC. Hỗ trợ người dùng thuận tiện hơn trong việc kết nối với nhiều thiết bị ngoại khác.</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Laptop MSI Stealth 16 Mercedes-AMG Motorsport tại sự kiện Computex 2023\" src=\"//file.hstatic.net/1000026716/file/-computex-2023-msi-tro-lai-voi-man-ket-hop-manh-me-cung-mercedes-amg-5_001f64bdfea0430fac172231f9dd67bc.png\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Phía trên là vài thông tin giới thiệu về chiếc laptop MSI Stealth 16 Mercedes-AMG Motorsport. Đến nay nhà MSI vẫn chưa công bố giá bán nhưng chắc chắn đây sẽ là một trong những chiếc laptop cao cấp bậc nhất phiên bản giới hạn mà MSI tự hào. Thiết kế đậm phong cách MSI pha lẫn cùng Mercedes-AMG mang đến một sản phẩm độc đáo và vô cùng ấn tượng. Bạn nghĩ sao về đứa con tinh thần được MSI ra mắt tại sự kiện Computex 2023 lần này. Hãy để lại bình luận cùng GEARVN nhé!</span></p>\r\n						</div>', 84, '2023-07-14', 'img.jpg\r\n'),
(4, 'Computex 2023 năm nay có gì?', 'Sự kiện máy tính lớn nhất hành tinh Computex 2023 đã trở lại và được giới công nghệ săn đón nhiệt liệt. Sự kiện Computex năm nay được đăng cai tại Đài Bắc, Đài Loan - cái nôi của hàng loạt ông lớn trong ngành công nghệ như Asus, ASRock, Gigabyte, MSI hay Acer. ', '<div class=\"article-pages p3\">\r\n							<p style=\"text-align: justify;\"><em><strong><span style=\"font-size:18px;\">Sự kiện máy tính lớn nhất hành tinh Computex 2023 đã trở lại và được giới công nghệ săn đón nhiệt liệt. Sự kiện Computex năm nay được đăng cai tại Đài Bắc, Đài Loan - cái nôi của hàng loạt ông lớn trong ngành công nghệ như Asus, ASRock, Gigabyte, MSI hay Acer.&nbsp;</span></strong></em></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Nếu như CES được biết đến là một triển lãm thương mại về công nghệ đình đám nhất trên Thế giới thì Computex sẽ là điểm dừng chân của những ông lớn phần cứng PC trên toàn cầu. Hội nghị diễn ra vào <strong><em>ngày 30 tháng Năm đến ngày 2 tháng Sáu</em></strong>. Sức hút của Computex là điều không thể bàn cãi bởi nó chính là nơi để các nhà sản xuất <a target=\"_blank\" href=\"https://gearvn.com/pages/linh-kien-may-tinh\">linh kiện PC</a> hay chip-maker đưa ra thông báo hay giới thiệu siêu phẩm chủ chốt của mình.</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Computex 2023 năm nay có gì?\" src=\"//file.hstatic.net/1000026716/file/gearvn-computex-2023-1__1__13092748d7c24a52bc4ee04bba71c61e_1024x1024.png\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Hãy gác lại Computex 2022 tương đối ảm đạm hay nói thẳng ra là có hơi chán thì hãy cùng <a target=\"_blank\" href=\"https://gearvn.com/\">GEARVN</a> xem qua sự kiện năm nay có gì hot nhé.</span></p><ul><li><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong>NVIDIA Keynote: </strong>Thật bất ngờ khi ông lớn NVIDIA không tận dụng Computex để ra mắt <a target=\"_blank\" href=\"https://gearvn.com/collections/vga-rtx-4060-ti\">RTX 4060</a> và 4060 Ti bởi chúng đã lên sàn từ tuần trước. Hội nghị năm nay, CEO Huang sẽ xuất hiện và giới thiệu về keynote - một sản phẩm AI mới của nhà NVIDIA.&nbsp;</span></p></li><li><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong>VGA AMD Radeon RX 7600: </strong>Cũng không có gì lạ khi AMD sẽ ra mắt VGA mới của mình ở Computex 2023. Còn có tin đồn cho rằng Radeon RX 7700 XT sẽ được chính thức bật mí trong buổi ra mắt này.&nbsp;</span></p></li><li><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong><a target=\"_blank\" href=\"https://gearvn.com/collections/laptop-gaming-acer\">Laptop Acer</a>: </strong>Như chúng ta đã biết từ trước, Acer sẽ ra mắt Acer Predator Triton 16 trong hội nghị lần này. Liệu có sự đổi mới, nâng cấp hay diện mạo mới nào khác cho màn comeback này không? Bên cạnh đó, phân khúc laptop văn phòng cũng sẽ có model <a target=\"_blank\" href=\"https://gearvn.com/collections/acer-swift-series\">Acer Swift</a> Edge 16 với một diện mạo cực kỳ cuốn hút ngay từ cái nhìn đầu tiên.</span></p></li></ul><div style=\"text-align: justify;\"><p style=\"text-align: center\"><img alt=\"GEARVN - Computex 2023 năm nay có gì?\" src=\"//file.hstatic.net/1000026716/file/gearvn-computex-2023-3_e016d681d4804cd5b5caad1705cc38b3_1024x1024.png\"></p></div><ul><li><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong>Thời của <a target=\"_blank\" href=\"https://gearvn.com/collections/case-thung-may-tinh\">case máy tính</a> là đây: </strong>Computex luôn được xem là thời điểm vàng để hàng loạt cái tên lớn như <a target=\"_blank\" href=\"https://gearvn.com/collections/case-lian-li\">Lian Li</a>, <a target=\"_blank\" href=\"https://gearvn.com/collections/case-coolermaster\">Cooler Master</a> và <a target=\"_blank\" href=\"https://gearvn.com/collections/case-thermaltake\">Thermaltake</a> tung ra sản phẩm mới và cả những bản mod case đặc biệt. Highlight của sự kiện luôn thuộc về Thermaltake và các casemod từng đạt giải thưởng của hãng.</span></p></li><li><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong>Cooler Master MasterHUB: </strong>Cooler Master đã mang MasterHUB đến với Computex 2023 như một lời ngầm khẳng định sẽ đối đầu với Elgato và bộ <a target=\"_blank\" href=\"https://gearvn.com/products/elgato-stream-deck-15-phim\">Stream Deck</a> nổi tiếng. Có thể hiểu rằng <a target=\"_blank\" href=\"https://gearvn.com/collections/phu-kien-streaming\">thiết bị streaming</a> này giúp người dùng điều khiển buổi livestream dễ dàng và tiện lợi hơn bao giờ hết nhờ thiết kế thời thượng cùng hàng loạt các dịch vụ streaming hỗ trợ khác.</span></p></li></ul><div style=\"text-align: justify;\"><p style=\"text-align: center\"><img alt=\"GEARVN - Computex 2023 năm nay có gì?\" src=\"//file.hstatic.net/1000026716/file/gearvn-computex-2023-7_9be39e0fc1b144108ba283d3c5675d4b_1024x1024.png\"></p></div><ul><li><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong>iCUE LINK của Corsair sẽ là trợ thủ đắc lực khi build PC: </strong>Sẽ không còn dây nhợ chằng chịt trong thùng case của bạn nữa. Mọi thứ chỉ còn là một đoạn dây cáp iCUE LINK của Corsair kết nối mọi linh kiện máy tính lại với nhau như <a target=\"_blank\" href=\"https://gearvn.com/collections/fan-rgb-tan-nhiet-pc\">quạt tản nhiệt</a>, tản nhiệt CPU,...góp phần tạo nên một hệ sinh thái thông minh và gọn gàng. Tuy nhiên, bạn cần lưu ý những linh kiện này phải cùng đến từ nhà Corsair mới có thể kết nối được nhé.</span></p></li></ul><div style=\"text-align: justify;\"><p style=\"text-align: center\"><img alt=\"GEARVN - Computex 2023 năm nay có gì?\" src=\"//file.hstatic.net/1000026716/file/gearvn-computex-2023-6_b4de63891f4249a894b4d60d02ce75e8_1024x1024.png\"></p></div><ul><li><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong>Màn hợp tác chấn động giữa <a target=\"_blank\" href=\"https://gearvn.com/blogs/cong-nghe/computex-2023-msi-tro-lai-voi-man-ket-hop-manh-me-cung-mercedes-amg\">MSI và Mercedes-AMG Motorsport</a>: </strong>Có vẻ như Mercedes đang rất tích cực hợp tác với nhiều ông lớn trong ngành công nghệ. Nếu như trước đây <a target=\"_blank\" href=\"https://gearvn.com/blogs/cong-nghe/tiktok-hop-tac-voi-mercedes-benz\">Mercedes Benz đã kết hợp với TikTo</a>k và mang ứng dụng này lên trên các model xe hạng sang của mình thì giờ đây tại Computex 2023 chúng ta sẽ chiêm ngưỡng model <a target=\"_blank\" href=\"https://gearvn.com/pages/laptop-gaming\">laptop gaming</a> MSI Stealth 16 Mercedes-AMG Motorsport. Thừa kế ngoại hình sang trọng và đẹp mắt như đối tác của mình kết hợp với hiệu năng khủng long vốn có của nhà Rồng đã tạo nên một phiên bản <a target=\"_blank\" href=\"https://gearvn.com/collections/laptop-msi-gaming\">laptop gaming MSI</a> rất mới lạ và độc đáo.</span></p></li></ul><div style=\"text-align: justify;\"><p style=\"text-align: center\"><img alt=\"GEARVN - Computex 2023 năm nay có gì?\" src=\"//file.hstatic.net/1000026716/file/gearvn-computex-2023-4_78ce2e83bf6446ce913b4074b5561b91_1024x1024.png\"></p></div><ul><li><p style=\"text-align: justify;\"><span style=\"font-size:18px;\"><strong>Corsair Dominator Titanium DDR5 RAM: </strong>Chúng ta phải công nhận sự tuyệt vời của nhà Corsair khi một lần nữa sản phẩm của hãng được vinh danh tại Computex 2023. <a target=\"_blank\" href=\"https://gearvn.com/collections/ram-pc\">RAM</a> vốn dĩ là một trong những thành phần cực kỳ quan trọng trong bất kỳ hệ thống <a target=\"_blank\" href=\"https://gearvn.com/pages/pc-gvn\">PC gaming</a> nào, tuy chưa được đánh giá quá cao nhưng cũng không thể phủ nhận tầm quan trọng bậc nhất của linh kiện này. Corsair chẳng một lời thông báo mà đánh úp Dominator Titanium DDR5 và có thể đây là một trong những sản phẩm công nghệ bậc nhất trong buổi triển lãm năm nay.</span></p></li></ul><div style=\"text-align: justify;\"><p style=\"text-align: center\"><img alt=\"GEARVN - Computex 2023 năm nay có gì?\" src=\"//file.hstatic.net/1000026716/file/gearvn-computex-2023-5_2bbf339508c54698ae8de6c636baf3fb_1024x1024.png\"></p></div><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Đây là những sản phẩm hot nhất trong sự kiện Computex 2023. Sự kiện vẫn còn tiếp tục diễn ra và GEARVN sẽ liên tục cập nhật những thông tin mới nhất về sự kiện trên để mọi người cùng theo dõi. Bạn cảm thấy như thế nào về sự kiện công nghệ Computex năm nay.</span></p>\r\n						</div>', 1, '2023-07-14', 'img.jpg'),
(5, 'Metal Gear Solid 3 Remake sắp ra mắt trên PC ?', 'Hiện tại, chưa có thông tin chính thức từ Konami về việc phát hành Metal Gear Solid 3 trên PC. Tuy nhiên, đã có nhiều tin đồn và thông tin rò rỉ về việc phát hành game này trên nền tảng PC. Chắc hẳn không ít con dân game PC cũng đang mong ngóng sự ra đời của tựa game Metal Gear Solid 3 trên PC như GEARVN phải không?', '<div class=\"article-pages p3\">\r\n							<p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Hiện tại, chưa có&nbsp;thông tin chính thức từ Konami về việc phát hành Metal Gear Solid 3 trên <a target=\"_blank\" href=\"https://gearvn.com/pages/pc-gvn\">PC</a>. Tuy nhiên, đã có nhiều tin đồn và thông tin rò rỉ về việc phát hành game này trên nền tảng PC. Chắc hẳn không ít con dân game PC cũng đang mong ngóng sự ra đời của tựa game&nbsp;Metal Gear Solid 3 trên PC như <a target=\"_blank\" href=\"https://gearvn.com/\">GEARVN</a> phải không?</span></p><h2 style=\"text-align: justify;\"><strong><span style=\"font-size:22px;\">Giới thiệu về game&nbsp;Metal Gear Solid 3</span></strong></h2><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Metal Gear Solid 3: Snake Eater là một trong những tựa game hành động giấu kín nổi tiếng và được đánh giá cao trong thể loại này. Game được phát triển bởi Kojima Productions và phát hành bởi Konami cho PlayStation 2 vào năm 2004.</span></p><p style=\"text-align: center\"><img src=\"//file.hstatic.net/1000026716/file/gearvn-metal-gear-solid-3-remake-sap-ra-mat-tren-pc-2_8e2e685ecbeb403da281ed7423f53847.jpg\" alt=\"GEARVN - Giới thiệu về game Metal Gear Solid 3: Snake Eater\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Trong Metal Gear Solid 3, người chơi vào vai Naked Snake, một điệp viên đặc biệt của Mỹ, được gửi đến vào thập niên 1960 để tiêu diệt một nhóm kẻ khủng bố và cứu một nhà khoa học quan trọng. Trong quá trình chơi, người chơi sẽ phải vượt qua các thử thách để tiến tới mục tiêu của mình, bao gồm tránh các bẫy và gài bẫy của kẻ địch, sử dụng các kỹ năng tàng hình để tránh sự chú ý của lính địch và giải quyết các câu đố để tiến tới mục tiêu.</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Một trong những điểm nổi bật của Metal Gear Solid 3 là cốt truyện hấp dẫn và đầy bất ngờ. Trong game, người chơi sẽ được đưa vào một thế giới đầy rẫy âm mưu và bí mật, với nhiều tình tiết đầy cảm xúc và gây sốc. Cốt truyện của game được xây dựng rất kỹ lưỡng, với những cuộc đối đầu giữa các nhân vật được diễn ra một cách hiệu quả và đầy kịch tính.</span></p><p style=\"text-align: center\"><img src=\"//file.hstatic.net/1000026716/file/gearvn-metal-gear-solid-3-remake-sap-ra-mat-tren-pc-7_d1168c8181104cf0ae0a4da5fce587f7_1024x1024.png\" alt=\"GEARVN - Giới thiệu về game Metal Gear Solid 3: Snake Eater\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Ngoài ra, Metal Gear Solid 3 cũng có hệ thống gameplay tốt hơn so với các phiên bản trước đó, bao gồm khả năng sử dụng thực phẩm và thuốc để hồi phục sức khỏe, và các vũ khí và trang bị đa dạng hơn. Game cũng cung cấp cho người chơi nhiều lựa chọn để tiếp cận mục tiêu,bao gồm sử dụng kỹ năng tàng hình, trang bị vũ khí hoặc tấn công trực tiếp.</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Đồ họa và âm thanh của Metal Gear Solid 3 cũng được đánh giá cao. Đồ họa được thiết kế chi tiết và chân thực, với các môi trường đa dạng và phong phú. Âm thanh của game cũng rất đặc biệt, với những bản nhạc độc đáo và phù hợp với từng tình huống trong game.</span></p><p style=\"text-align: center\"><img src=\"//file.hstatic.net/1000026716/file/gearvn-metal-gear-solid-3-remake-sap-ra-mat-tren-pc-8_7e43073223f64377b965fad71b33ce54_1024x1024.png\" alt=\"GEARVN - Giới thiệu về game Metal Gear Solid 3: Snake Eater\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Metal Gear Solid 3 cũng có nhiều tính năng đặc biệt và nổi bật, bao gồm chế độ chơi nâng cao, khả năng thực hiện các động tác chiến đấu phức tạp và khả năng sử dụng các vật phẩm khác nhau để giải quyết các tình huống khác nhau.</span></p><h2 style=\"text-align: justify;\"><strong><span style=\"font-size:22px;\">Liệu&nbsp;Metal Gear Solid 3 Remake sẽ có trên PC?</span></strong></h2><div><span style=\"font-size:18px;\">Metal Gear Solid 3 được phát hành lần đầu tiên vào năm 2004 cho <a target=\"_blank\" href=\"https://gearvn.com/blogs/thu-thuat-giai-dap/tong-hop-nhung-dong-may-choi-game-cam-tay-dang-mua-nhat\">máy chơi game cầm tay</a>&nbsp;PlayStation 2 và đã được tái phát hành trên nhiều nền tảng khác nhau như PlayStation 3, Xbox 360, và PlayStation Vita, Nintendo 3DS.</span></div><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Trong thời gian gần đây, có nhiều thông tin rò rỉ về việc Metal Gear Solid 3 sẽ được phát hành trên PC thông qua Steam hoặc Epic Games Store. Nhiều fan của series đã rất phấn khích với thông tin này và đang mong chờ được chơi lại game trên nền tảng PC với đồ họa tốt hơn và khả năng tùy chỉnh cao hơn. Tuy nhiên, cũng cần lưu ý rằng đó chỉ là những tin đồn và thông tin rò rỉ chưa được xác nhận bởi Konami hoặc bất kỳ đại diện chính thức nào của họ. Chúng ta cần đợi thêm thông tin chính thức từ Konami về việc phát hành&nbsp;Metal Gear Solid 3&nbsp;trên PC để có được những thông tin chính xác và chi tiết hơn về sản phẩm này.</span></p><p style=\"text-align: center\"><img src=\"//file.hstatic.net/1000026716/file/gearvn-metal-gear-solid-3-remake-sap-ra-mat-tren-pc-6_f982549d1f8e481899f8bdd2ed56ab91_1024x1024.jpg\" alt=\"GEARVN - Liệu&nbsp;Metal Gear Solid 3 Remake sẽ có trên PC?\"></p><p style=\"text-align: center;\"><em><strong><span style=\"font-size:18px;\">Xem video giới thiệu về bản remake&nbsp;Metal Gear Solid 3 <a target=\"_blank\" rel=\"nofollow\" href=\"https://www.youtube.com/watch?v=1YDauj2Ayog&amp;t=7s\">tại đây</a>.</span></strong></em></p>\r\n						</div>', 0, '2023-07-14', 'img.jpg'),
(6, 'Tin đồn về chip M3 mạnh mẽ nhất từ trước đến nay của Apple sắp ra mắt', 'Sản phẩm của Apple luôn là chủ đề \"nóng hổi\" được nhiều người quan tâm. Và tin đồn về chip M3 cũng là một trong số những điều mà fan nhà Táo mong chờ. Cùng GEARVN điểm qua một vài thông tin về mẫu chip M3 nhà Táo này có gì hấp dẫn nhé. ', '<div class=\"article-pages p3\">\r\n							<p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Sản phẩm của Apple luôn là chủ đề \"nóng hổi\"&nbsp;được nhiều người quan tâm. Và tin đồn về chip M3 cũng là một trong số những điều mà fan nhà Táo mong chờ. Cùng GEARVN điểm qua một vài thông tin về mẫu chip M3 nhà Táo này có gì hấp dẫn nhé.&nbsp;</span></p><h2 style=\"text-align: justify;\"><strong><span style=\"font-size:22px;\">Macbook Air và Macbook Pro sử dụng chip M3 mới&nbsp;</span></strong></h2><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Theo nguồn tin từ 9to5Mac cho hay Apple đang nghiên cứu và phát triển chip M3 cho hàng loạt sản phẩm mới của họ. Hai mẫu máy <a target=\"_blank\" href=\"https://gearvn.com/collections/macbook-air\">Macbook Air</a> 13 inch (J513) và Macbook Air 15 inch (J515) đang được sản xuất và được biết rằng chúng đã sẵn sàng hoạt động cùng hiệu suất từ chip M3 mới nhất.&nbsp;</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Chip M3 sẽ được trang bị trên Macbook Air và Macbook Pro sắp tới\" src=\"//file.hstatic.net/1000026716/file/in-don-ve-chip-m3-manh-me-nhat-tu-truoc-den-nay-cua-apple-sap-ra-mat-2_cae347ee04e641b89fba9fc17cd7e0ca.png\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Tương tự như chip M1 và M2, M3 cũng sẽ có cấu trúc CPU 8 nhân. Điểm khác biệt có lẽ nằm ở tiến trình xây dựng 3nm của TSMC, nhờ vậy M3 được mọi người trông chờ vào sức mạnh vượt trội cũng như những cải tiến mạnh mẽ hơn thế hệ cũ.&nbsp;</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Chip M3 sẽ được trang bị trên iMac 24inch sắp tới\" src=\"//file.hstatic.net/1000026716/file/in-don-ve-chip-m3-manh-me-nhat-tu-truoc-den-nay-cua-apple-sap-ra-mat-3_396e3b8fea134c1cad5e5002ed6e5816.png\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Apple cũng có kế hoạch làm mới <a target=\"_blank\" href=\"https://gearvn.com/collections/macbook-pro\">Macbook Pro</a> 13 inch với con chip Apple Silicone mới nhất với tên mã là J504. Vì thế con chip M3 8 nhân cũng sẽ được sử dụng trên dòng máy J504 này. Bên cạnh đó, Apple cũng sẽ công bố chiếc <a target=\"_blank\" href=\"https://gearvn.com/pages/imac\">iMac</a> thế hệ mới sử dụng chip M3. Hứa hẹn một kỷ nguyên đột phá về hiệu suất của <a target=\"_blank\" href=\"https://gearvn.com/pages/pc-gvn\">máy tính bàn</a> cho mọi yêu cầu công việc.</span></p><h2 style=\"text-align: justify;\"><strong><span style=\"font-size:22px;\">Khi nào thì Apple chip M3 sẽ ra mắt</span></strong></h2><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Vậy khi nào thì những sản phẩm <a target=\"_blank\" href=\"https://gearvn.com/pages/apple\">Apple</a> sử dụng chip M3 sẽ được ra mắt? Đó là điều mà hầu hết con dân nhà Táo đều mong chờ. Hiện tại vẫn chưa có thông báo chính xác về thời gian công bố sản phẩm mới từ nhà Táo. Nhưng theo như Mark Gurman chia sẻ thì ít nhất Apple sẽ giới thiệu loạt sản phẩm mới vào tháng 6 tại sự kiện WWDC năm nay.</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Dự đoán chip M3 sẽ được công bố tại sự kiện WWDC 2023\" src=\"//file.hstatic.net/1000026716/file/in-don-ve-chip-m3-manh-me-nhat-tu-truoc-den-nay-cua-apple-sap-ra-mat-4_3198ba7fd5134628ba08705befcb381c.jpg\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Một điều đáng chú ý là chip M2 đã được Apple công bố tại sự kiện WWDC 2022 cùng với sản phẩm Macbook Air và Macbook Pro 13inch. Vì thế nếu Apple có lặp lại điều tương tự tại WWDC để ra mắt những sản phẩm chip M3 cũng không còn là điều quá ngạc nhiên.&nbsp;</span></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Nếu bạn là fan Táo chắc hẳn cũng sẽ rất háo hức và mong chờ sự kiện ra mắt sản phẩm sắp tới của Apple. Hãy cùng GEARVN đón chờ sức mạnh vượt trội và những cải tiến mới từ Apple chip M3 nhé!</span></p><p style=\"text-align: justify;\"><u><strong><span style=\"font-size: 18px;\">Có thể bạn quan tâm:&nbsp;</span></strong></u></p><ol><li><span style=\"font-size:18px;\"><a target=\"_blank\" href=\"https://gearvn.com/blogs/cong-nghe/wwdc-2023-co-gi\">WWDC 2023: Sự kiện lớn nhất của Apple năm nay sẽ có gì?</a></span></li><li><span style=\"font-size:18px;\"><a target=\"_blank\" href=\"https://gearvn.com/blogs/cong-nghe/tong-hop-tinh-nang-tren-ios-16-4-cua-apple\">Tổng hợp tính năng trên iOS 16.4 của Apple</a></span></li><li><span style=\"font-size:18px;\"><a target=\"_blank\" href=\"https://gearvn.com/blogs/cong-nghe/asus-ra-mat-may-choi-game-cam-tay-asus-rog-ally\">ASUS ra mắt máy chơi game cầm tay Asus ROG Ally</a></span></li><li><span style=\"font-size:18px;\"><a target=\"_blank\" href=\"https://gearvn.com/blogs/cong-nghe/google-io-2023\">Google I/O 2023 có gì đáng mong đợi?</a></span></li></ol>\r\n						</div>', 0, '2023-07-14', 'img.jpg'),
(7, 'ASUS ra mắt máy chơi game cầm tay Asus ROG Ally', 'Nếu như cá tháng tư là ngày dành cho những lời nói dối thì ASUS lại không dành cho những cú lừa. Họ đã chính thức ra mắt máy chơi game cầm tay ASUS ROG Ally thế hệ mới. Hứa hẹn sẽ là một trong những đối thủ đáng gờm của Steam Deck trong thời gian sắp tới. ', '<div class=\"article-pages p3\">\r\n							<p style=\"text-align: center\"><a target=\"_blank\" href=\"https://gearvn.com/products/may-choi-game-asus-rog-ally-white\"><img src=\"//file.hstatic.net/1000026716/file/1_1_36f3283fd1b4424aaa786773a86592d6.jpg\"></a></p><p style=\"text-align: justify;\">&nbsp;</p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Nếu như cá tháng tư là ngày dành cho những lời nói dối thì ASUS lại không dành cho những cú lừa. Họ đã chính thức ra mắt <a target=\"_blank\" href=\"https://gearvn.com/blogs/thu-thuat-giai-dap/tong-hop-nhung-dong-may-choi-game-cam-tay-dang-mua-nhat\">máy chơi game cầm tay</a> ASUS ROG Ally thế hệ mới. Hứa hẹn sẽ là một trong những đối thủ đáng gờm của Steam Deck trong thời gian sắp tới.&nbsp;</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Ra mắt máy chơi game cầm tay Asus ROG Ally\" src=\"//file.hstatic.net/1000026716/file/gearvn-asus-ra-mat-may-choi-game-cam-tay-asus-rog-ally-2_5e9ec70ac6474765a37d102ec9e9e27e.jpg\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Vào ngày 1/4/2023, ASUS đã công bố thiết bị chơi game cầm tay đầu tiên của mình với tên gọi là ASUS ROG Ally. Được xây dựng dựa trên APU AMD giống như Steam Deck và chạy bằng hệ điều hành Windows 11. Hỗ trợ người chơi truy cập vào nhiều trò chơi với độ tương thích cao. Nếu bạn cảm thấy chán với việc giải trí trên những chiếc <a target=\"_blank\" href=\"https://gearvn.com/pages/pc-gvn\">PC</a>, <a target=\"_blank\" href=\"https://gearvn.com/collections/laptop\">laptop</a> thì đây sẽ là lựa chọn vô cùng lý tưởng đáng để thử.&nbsp;</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Ra mắt máy chơi game cầm tay Asus ROG Ally\" src=\"//file.hstatic.net/1000026716/file/gearvn-asus-ra-mat-may-choi-game-cam-tay-asus-rog-ally-5_89e8d585709743cf85504858cfb78fa7.jpg\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Đến nay những thông tin về phần cứng của <a target=\"_blank\" href=\"https://gearvn.com/collections/laptop-asus-oled\">ASUS</a> ROG Ally vẫn còn khá ít. Nhưng ASUS cũng đã giới thiệu những điểm nổi bật mà chiếc máy này mang lại. Trang bị APU AMD nhanh nhất từ trước đến nay cho tốc độ xử lý và tải dữ liệu mạnh mẽ. Hệ thống tản nhiệt bằng quạt kép yên lặng sẽ là lựa chọn thích hợp giải trí cho không gian cần sự yên tĩnh. Màn hình Full HD trang bị khả năng hiển thị tốt. Dù cho đó có là ánh sáng chói chang ngoài trời cũng không cản được phút giây đắm chìm vào game của bạn. Các nút điều khiển vật lý và D-Pad đặt ở hai cạnh bên để việc điều khiển trò chơi hay truy cập menu một cách dễ dàng và thuận tiện.&nbsp;</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Ra mắt máy chơi game cầm tay Asus ROG Ally\" src=\"//file.hstatic.net/1000026716/file/gearvn-asus-ra-mat-may-choi-game-cam-tay-asus-rog-ally-6_4abcad1c1b8d4894bb68c0353c30290d.jpg\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Điểm khác biệt trên <a target=\"_blank\" href=\"https://gearvn.com/collections/laptop-asus-rog-series\">ASUS ROG</a> Ally so với Steam Deck là bạn có thể cắm ROG XG Mobile eGPU độc quyền từ ASUS. Hỗ trợ toàn lực để phát huy tiềm năng của Ally trên chiếc máy chơi game cầm tay. Qua đó việc chiếu lên một chiếc màn hình tivi lớn hơn sẽ giúp bạn có được tầm nhìn và chơi game tốt hơn.&nbsp;</span></p><p style=\"text-align: center\"><img alt=\"GEARVN - Ra mắt máy chơi game cầm tay Asus ROG Ally\" src=\"//file.hstatic.net/1000026716/file/gearvn-asus-ra-mat-may-choi-game-cam-tay-asus-rog-ally-3_4e5ed730d3884cbf97b44b53c6d996aa.jpg\"></p><p style=\"text-align: justify;\"><span style=\"font-size:18px;\">Xem qua đoạn giới thiệu ROG Ally từ nhà ASUS chắc hẳn bạn sẽ không thể cưỡng lại sức hút của chiếc máy này. Hãy để lại đánh giá để cùng GEARVN bình luận nhé!&nbsp;</span></p><blockquote><p style=\"text-align: justify;\"><strong><em><span style=\"font-size:18px;\">Xem video giới thiệu ASUS ROG Ally <a rel=\"nofollow\" target=\"_blank\" href=\"https://www.youtube.com/watch?v=s5lq4Q7YAjE\">tại đây</a>.</span></em></strong></p></blockquote>\r\n						</div>', 2, '2023-07-14', 'img.jpg');
